membership from about 300 to 869 members. The innovation was delivered in October 2021. The VCO had 8 collection centers but in December 2021, the collection centers increased to 17. as a result, milk collection increased from about 900kg per day to about 1600 kg per day in December. At the end of year 2021, the VCO had aggregated 396201 kgs of milk which is an increase from 292112 kgs of milk collected in year 2020  before  the innovation was delivered. The innovation has brought in an additional 104000 kgs for the cooperative in the year earning a total of 5.2m extra income for the farmers. The VCO has also employed 2 (male youth) motorcycle rides and 1 milk grader (female youth) earning a total of ksh 324,000 in a year. The VCO buys milk from farmers @35/= per liter and sells at an average of 42/= per liter. Therefore the VCo offers a guaranteed market for its members and has employed 2 youth riders and 1 milk grader who receives an average of 9000/- per month.',NULL,NULL,3,2,NULL,NULL,NULL,NULL,605,312,293,63,NULL,NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,1,NULL,'2023-05-26 05:08:11','2023-05-26 05:08:11','Taita, Mwatate and Taveta',NULL,'Delivered to beneiciaries','269','273','43','20','Enhanced milk collection, its tested at collection point before delivery to cooling tanks at aggregation centers.','Realton Mwangemi','722475302',NULL,NULL,'Farmers were losing evening milk and also morning milk due to use of improper milk containers and mode of transport. Milk aggregated, group based collection centers were minimal.',NULL),(108,11,'Lanbib Farm Group','Lanbib',NULL,NULL,'Solar powered pumpset, tank, stand and reticulation piping.','44F60820',NULL,'Water extraction and reticulation to the farm using solar powered pump sets.','Increased area under production from 4 acreas to 7 acreas. Productivity increased from  15 tons to 20 tons per acre. Reduced cost of fuel.',NULL,NULL,1,NULL,'ASDSP II Wajir Office',NULL,NULL,NULL,10,6,4,2,NULL,NULL,NULL,'Pending',NULL,