dlings','2','6','2','3','Easy to Use and maintain by both Women and youth','Kazi Oduor','722577270',NULL,NULL,'Mango production group',NULL),(191,20,'Alego farmers','Central Alego',NULL,NULL,'Mango Seedlings','35Z47591',NULL,'Grafted seedlings','Good orchards established',NULL,NULL,1,8,'ASDSP Office',NULL,NULL,NULL,12,9,3,2,NULL,NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,1,NULL,'2023-05-26 06:09:22','2023-05-26 06:09:22','Alego Usonga',NULL,'Mango Seedlings','7','3','2','0','Easy to Use and maintain by both Women and youth','Chirande caleb','752309394',NULL,NULL,'Mango production group',NULL),(192,20,'Ten Sisters ','South East Alego',NULL,NULL,'Mango Seedlings','5181966F',NULL,'Grafted seedlings','Good orchards established',NULL,NULL,1,8,'ASDSP Office',NULL,NULL,NULL,15,0,15,3,NULL,NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,1,NULL,'2023-05-26 06:09:22','2023-05-26 06:09:22','Alego Usonga',NULL,'Mango Seedlings','0','12','0','3','Easy to Use and maintain by both Women and youth','Caroline A.','723927249',NULL,NULL,'Mango production group',NULL),(193,20,'SAVIIC','South East Alego',NULL,NULL,'knapsack Sprayer ','83U71051',NULL,'20 liters, manual knapsack sprayer ','Good orchards established',NULL,NULL,1,8,'ASDSP Office',NULL,NULL,NULL,13,8,5,8,NULL,NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,1,NULL,'2023-05-26 06:09:22','2023-05-26 06:09:22','Alego Usonga',NULL,'knapsack Sprayer ','2','3','6','2','Easy to Use and maintain by both Women and youth','Julius Huma','725389911',NULL,NULL,'Mango production group',NULL),(194,35,'Double green pyrethrum growers','Kinungi','0.8041','36.5355','PYRETHRUM TISSUE CULTURE MATERIALS','78V75679',NULL,'<p style=\"text-align: justify;\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\">Pyrethrum tissue culture materials<br />\r\n<a href=\"https://drive.google.com/file/d/1_eIiZBbliaDEccR4AQkHDfmzXSK7T8Wx/view?usp=sharing\">https://drive.google.com/file/d/1_eIiZBbliaDEccR4AQkHDfmzXSK7T8Wx/view?usp=sharing</a></span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"line-height:114%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\"><span style=\"line-height:114%\"><span style=\"font-family:Symbol\">&middot; </span></span></span><span style=\"font-size:10.0pt\"><span style=\"line-height:114%\">Improved productivity-</span></span><span style=\"font-size:10.0pt\"><span style=\"line-height:114%\"> Each member has been able to come up with individual farms of at least &frac14; an acre</span></span></span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:114%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\"><span style=\"line-height:114%\"><span style=\"font-family:Symbol\">&middot; </span></span></span><span style=\"font-size:10.0pt\"><span style=\"line-height:114%\">Increased competitiveness.</span></span></span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:114%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\"><span style=\"line-height:114%\"><span style=\"font-family:Symbol\">&middot; </span></span></span><span style=\"font-size:10.0pt\"><span style=\"line-height:114%\">Improved brand recognition and value.</span></span></span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:114%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\"><span style=\"line-height:114%\"><span style=\"font-family:Symbol\">&middot; </span></span></span><span style=\"font-size:10.0pt\"><span style=\"line-height:114%\">New partnerships and relationships.</span></span></span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:114%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\"><span style=\"line-height:114%\"><span style=\"font-family:Symbol\">&middot; </span></span></span><span style=\"font-size:10.0pt\"><span style=\"line-height:114%\">Increased turnover and improved profitability-</span></span><span style=\"font-size:10.0pt\"><span style=\"line-height:114%\">-They are aggregating their pyrethrum and are expecting to be selling at Ksh. 400/= kg and not the current price of Ksh.230/=</span></span></span></span></span></p>','0','Drying innovations',2,24,'County ASDSP II offices',NULL,NULL,NULL,16,8,8,2,'168682134640X.jpg',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-06-15 09:39:33','1',1,NULL,'2023-06-15 06:38:42','2023-06-15 06:39:33','207','Kinungi','Delivered to beneficiaries','6','8','2','0','0','Mr. Ndungu','0722-394416',NULL,NULL,'<p><span style=\"font-size:12pt\"><span style=\"line-height:13.7pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:Symbol\">&middot; </span></span><span style=\"font-size:10.0pt\">The group started in 2015with a membership of 20 persons with no pyrethrum.</span></span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:13.7pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:Symbol\">&middot; </span></span><span style=\"font-size:10.0pt\">The initial group project was planting of onions and tomatoes in green houses using greenhouses alongside a merry go round with contributions of KES 20/- per month per member.</span></span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:13.7pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:Symbol\">&middot; </span></span><span style=\"font-size:10.0pt\">In November 2021, the group decided to embrace pyrethrum production. Members willing to embrace pyrethrum signed contracts with Kentegra and were supplied with pyrethrum seedlings minimum was for &frac14; acre and 10 kg of planting fertilizer after paying a commitment fee of KES 1000/-.</span></span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:13.7pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:Symbol\">&middot; </span></span><span style=\"font-size:10.0pt\">The group was also a beneficiary of ASDSP II Innovation grant in 2022 and were supplied with 5,000 pyrethrum tissue culture seedlings.</span></span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:13.7pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:Symbol\">&middot; </span></span><span style=\"font-size:10.0pt\">At least each member harvests 30kg/1/4 an acre but have been marketing individually.</span></span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:13.7pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:Symbol\">&middot; </span></span><span style=\"font-size:10.0pt\">Currently they have decided to aggregate their pyrethrum and are selling to PPCK expected to be delivered by the end of June, 2023. They will be paid according to the pyrethrin content unlike current situation where they are being paid a flat rate of Ksh. 230/= per kg.</span></span></span></span></p>',NULL),(195,31,'Lelkoros Women Group','Lelmokwo','0.38762','35.15658','High capacity incubators ,Hatchers and Brooders','0552G574',NULL,'<div style=\"text-align: justify;\"><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Use of incubators and hatchers is a technology that aims at increasing supply of chicks to farmers in the county and beyond. This will ensure consistent and efficient supply of chicks which will lead to increase in profitability and productivity of chicken and its products while Chick brooders is an approach that aims at reducing mortality rate of chicks which eventually increases the number of chicks and enhances productivity at production stage. The brooders will be complimented with vaccination of chicken through training of personnel and farmers to carry out the vaccination exercise. This will result in increase of chicken and its products available for trading. The &nbsp;interested farmers&#39; have a chance to source vaccinated chicks from the ATC at a competitive and subsidized prices.The chicks are sold at 100 Kshs day old which has been a beneficial to the members of indigenous chicken value chain. The VCO has 2 incubators &nbsp;of &nbsp;528 egg capacity which hatches up to 85% in a cycle..The sale of chicks gives the group approximately ksh100,000 in less than 3months.The group also supplies&nbsp; an hotel in Eldoret with slaughtered chicken at 700ksh per piece getting around&nbsp; ksh 60,000 per month. ASDSP in collaboration with service providers both private and public which include department of livestock, agrochemicals (kukuchick, Sidai,) Uwezo fund,women enterprise fund, equity bank has trained on chick management, disease management, feed formulation, general chicken husbandry, financial literacy,and group dynamics. Also from their fellow VCO members through feedback from tours and workshops attended by selected individuals. The group has been getting their finances from Uwezo fund and women enterprise fund though some individuals get from Kenya women finance trust (KWFT) to top up their enterprise. The loans from women enterprise fund was taken in phases of 100,000ksh, 150,000ksh,350,000ksh,500,000ksh and kshs 750,000 these amounts is used by the VCO to develop the value chain .</span></span></div>','<div style=\"text-align: justify;\"><span style=\"font-size:12pt\"><span style=\"line-height:114%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">From the sale of the chicks, profits approximately 100,000ksh in 3 months every individual has put up an improved poultry house, paid school fees for their children and also diversified by buying a dairy animal for each member. Also to the community ,other VCAs have emulated the group by building improved houses for their chicken, also capacity building on chick management from the group. The anticipated impact is from the high capacity incubators ,hatcher and brooders for which the group through ASDSP have been given to manage on behave of the entire indigenous chicken VC in the county.2112eggs hatched will address the chick shortage to some extend and also the parent stock which will have a constant egg supply for incubation. The slaughter facility will also have enough chicken for processing.</span></span> </span></span></span></div>','0','Animal / crop Breeding innovations',4,5,'County ASDSP II offices',NULL,NULL,NULL,20,6,14,2,'168805921440X.jpg',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-06-29 17:37:13','1',1,NULL,'2023-06-29 14:36:53','2023-06-29 14:37:13','27','Lelmokwo','Delivered to beneficiaries','5','13','1','1','0','Salome Koech','0727270160',NULL,NULL,'<span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Lelkoros women group is&nbsp; a poultry keeping group located in Chesumei subcounty,&nbsp;Lelmokwo ward in Nandi County. It was started in the year 2011 as a merry go round with 15 members and later in 2013 it was registered by the social services&nbsp; with certificate NO.3295894. ASDSP 1 in 2013 identified the VCO&nbsp; as among the 60 VCOs in indeginous chicken value chain Which has since then benefited a lot in terms of capacity building on issues touching poultry especially feeds&nbsp; and husbandry. The VCO has an incubator of 528 egg capacity which hatches up to 85% in a cycle and the chicks are shared amongst members to be sold in different categories(day old,1 month and 3 months old)of chicks and get approximately 100,000ksh in less than 3 months.The group also supplies some hotel in Eldoret with slaughtered chicken at 700ksh per piece getting around 60,000ksh.The 2112 egg incubator has incubated two batches of eggs which were soused from Kalro Naivasha. &nbsp;</span></span><br />\r\n&nbsp;',NULL),(196,31,'Nandi Dairy Cooperative Union','Kabiyet Market','0.39635','35.08731','Embracing use of feed analyzers & milk testing kits to enhance milk quality','Z9100676',NULL,'<span style=\"font-size:10.5pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">ASDSP II, through its strategic integrated value chain action plan objective of promoting innovative technologies that have high prospects for women and youth and in taking advantage of the identified opportunity of the unmet annual demand of 109,373,550 liters of quality raw milk annually has supported the acquisition of milk testing kits and a feed analyzer to ensure improved quality milk and feeds and enhance capacity of producer value chain actors (VCA) increase milk productivity. The innovations are implemented through a partnership with NDCU, the county government and ASDSP alongside other identified innovations and climate smart technologies.</span></span></span></span></span></span><br />\r\n&nbsp;','<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">It is expected that the acquired testing kits will address the challenges faced by dairy value chain actors including; low quality and unstandardized feeds, non-compliance to regulations by milk handlers and feed processors, milk adulteration, high prevalence of aflatoxins in feeds and high levels of antibiotic residues in milk.</span></span></span></span></span></span><br />\r\n&nbsp;','0','Animal / crop Breeding innovations',2,2,'County ASDSP II offices',NULL,NULL,NULL,14088,6954,7134,2164,'168806106440X.jpg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,1,NULL,'2023-06-29 14:51:40','2023-06-29 14:51:40','211','Kabiyet','Delivered to beneficiaries','5790','6134','1164','1000','0','Abraham Rugut','0735555',NULL,NULL,'<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">The dairy sub sector in Nandi County has for a long time been marred with a number of constraints facing the industry that include; h</span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">igh post-production milk losses due to spoilage and spillages that account up to 10%, inadequate milk collection systems limiting market access</span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"> and l</span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">ow/fluctuating raw milk prices due to seasonality occasioned by the weather patterns coupled with dependency by the small scale farmers on rain fed systems of production that occasionally lead to feed shortages especially during the dry season. Producers often are faced with high cost of production occasioned by high cost of feeds that in most cases doesn&rsquo;t meet the quality requirements especially the dairy concentrates. All these factors render the dairy value chain unprofitable and this scenario is supported by the low gross margin levels especially for the producers that stands at 35%. The average production of milk per cow per day stands at 4.6 litres which is low as compared to a potential of 10 litres attributed to low quality feeds.</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">To mitigate the above challenges, Nandi Dairy Cooperative Union was established in 2016 as an initiative of ASDSP I to bring all the dairy cooperatives together in order to address production and market related challenges. It constitutes 41 affiliate Dairy Cooperative Societies in the county. Collectively during the flush season, the cooperative societies collect an estimated 120,000 litres per day. However, due to feed inadequacy during the dry period, the amount of milk collected decreases to about 50,000 litres. The milk is marketed raw and chilled through the major milk processors in Kenya with fluctuating producer prices.&nbsp;&nbsp; Other farmers in the County market their milk raw through the informal sector resulting to high post-harvest losses and unstable market.&nbsp; The county produces an estimated 778,288 litres per day hence only 6% is value added. The Nandi </span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Dairy Cooperative Union was therefore established with the aim of venturing into milk processing for value addition to solve the challenges of low and fluctuating milk prices offered by the processors, irregular payment and non-adherence to contractual supply agreements and to provide a sustainable structured market access for target beneficiary smallholder farmers. </span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">In this regard, the NDCU with support from Nandi County Government, the National Government and the World Bank funded Programme; NARIGP are in the process of establishing a Nandi County Creameries (NCC) milk processing plant that will on completion process 100,000 liters per day of raw milk and milk products and market for the more than 32,000 of its members. It will increase volume of milk aggregated for processing from the 41 cooperative societies by 50%. The value added milk will ensure market access and this will spur increase in productivity across all the VC nodes and lead to enhanced incomes due to improved producer prices from the current farm gate price of Ksh. 30 to Ksh. 45 per Litre of milk delivered. </span></span></span></span></span></span><br />\r\n&nbsp;',NULL),(197,31,'Senetwo Fish Farm','Senetwo','0.57605','35.82511','UNLOCKING THE POTENTIAL OF FISH PRODUCTIVITY IN NANDI COUNTY THROUGH PRODUCTION OF QUALITY FINGERLINGS','3905595I',NULL,'<span style=\"font-size:12pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">New Fish Hatchery will bridge the increasing demand gap for fingerlings supply in Nandi County. In an effort to develop viable innovations for increased fish value chain productivity, improve household&rsquo;s income and boost food security, the County Government of Nandi through the ASDSP II Programme is undertaking various fish farming programmes activities across the county one being through establishment of a new fingerling hatchery in the county that is; unique, efficient, cost effective, climate smart and sustainable in the long run as compared to the conventional fingerling hatcheries, it is positive that the demand gap in fingerling supply shall be bridged. The technology can therefore be easily adopted and replicated by other fish value chain actors. </span></span></span></span></span></span><br />\r\n&nbsp;','<span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">It is anticipated that with business skills development, good agronomic practices and market linkages, the innovation will serve 3342 VCAs (448 male, 742 female and 2152youth) fish producers to have access to quality fingerlings thereby increasing productivity hence contributing to the market demand for 220 tones of traded fish annually. The current marketed volumes is at 100 tons annually. With annual demand of 220 tons of traded fish pulling the chain, the node specific innovavtion will leverage on specific needs presented by the adjcent nodes thus contributing to the competiveness of the entire value chain. This innovation has high prospect of women and youth empowerment as it requires limited land holding, less laboriouse and women can easily combine this with other reproductive roles. In the long run, it is envisaged that this fingerling production innovation will contribute to the goal of ASDSP II by supplying quality fingerlings thereby contributing to the transformation&nbsp; Fish Priority Value Chain into a commercially oriented enterprise for improved income and food&nbsp; security.</span></span></span></span></span></span><br />\r\n&nbsp;','0','Animal / crop Breeding innovations',4,15,'County ASDSP II offices',NULL,NULL,NULL,21,13,8,9,'168806205240X.jpg',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-02 13:20:47','1',1,NULL,'2023-06-29 15:11:16','2023-11-02 10:20:47','211','Senetwo','Delivered to beneficiaries','8','4','5','4','0','Shadrack Melli','07899000',NULL,NULL,'<span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Fish is not only important for food and nutrition security, but is also one of the solutions to hidden hunger (a micronutrient deficiency of mainly vitamins and minerals that leads to poor nutrition, poor health, reduced productivity and therefore increased poverty and decreased economic growth). Household fish farming improves nutritional status directly through access to fish protein. Integration of fish farming into an already existing agricultural system increases production and overall farm productivity. Substantial gains in the much needed food security and economic growth especially in rural areas have generally not been achieved.</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Lack of good quality fingerlings, feed and technical advice; poor market infrastructure and access has attributed to inadequate food nutrition and security. According to ASDSP II, one of the gaps identified by actors in the VC through the Strategic Integrated Value Chain Action Plan (SIVCAP) process was limited supply of fingerlings. &quot;The current demand of fingerlings stands at 1,439,560 against a supply of 111,000 produced per year.</span></span></span></span></span></span><br />\r\n&nbsp;',NULL),(198,1,'New Mutuini Poultry Self Help Group','wuumiririe','-1.2958775','36.7985540','Defeathering Machines','959181U0','<ul>\r\n	<li>To reduce the&nbsp;<span style=\"font-size:12pt; text-align:justify\"><span style=\"font-family:&quot;Times New Roman&quot;\">processing time of birds from 25 birds/</span></span><span style=\"font-size:12pt; text-align:justify\"><span style=\"font-family:&quot;Times New Roman&quot;\">hr</span></span><span style=\"font-size:12pt; text-align:justify\"><span style=\"font-family:&quot;Times New Roman&quot;\">/person to 250 birds/</span></span><span style=\"font-size:12pt; text-align:justify\"><span style=\"font-family:&quot;Times New Roman&quot;\">hr</span></span><span style=\"font-size:12pt; text-align:justify\"><span style=\"font-family:&quot;Times New Roman&quot;\"> per person.</span></span></li>\r\n	<li><span style=\"line-height:90%\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;\">To save cost by&nbsp;12.7/= per bird.</span></span></span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"line-height:90%\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;\">To increase women and youth employment</span></span></span></li>\r\n</ul>','<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The&nbsp; de-feathering machine should be able to process 8-10 birds per cycle and should be food grade (stainless steel)</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Note:</span></span></span></strong><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> -Provide an operation manual</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"f