/span>','Lowered the cost of one day chicks by 55% resulting to flock improvement from 6 to 50 birds per member thus increased gross margins.','0','Animal / crop Breeding innovations',4,5,'County ASDSP II offices',NULL,NULL,NULL,27,23,4,16,'169935973420X.jpeg',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-09 13:24:57','1',2211,NULL,'2023-11-07 09:24:15','2023-11-09 10:24:57','430','Narumoru/Kiamathaga','Delivered to beneficiaries','11','0','12','4','0','Jackson Mutabacho Wanyiri','+254721619054',NULL,NULL,'The hails from Aguthi, Narumoru/Kiamathaga ward in Kieni East Sub-County. The group was established in the year 2019 with an objective of exchanging ideas and improves on farming techniques due to the drought challenges in the region. The group got in to indigenous chicken production though with a myriad of challenges especially of high mortality and high cost of inputs. ASDSPII capacity building interventions led to adoption of various innovations which led to reduced mortality and cost of feeds.&nbsp;',NULL),(224,44,'Mitero Mixed Self Help Group','Mitero','E0365647.8','S002516.6','192 egg capacity solar powered incubator with brooder pot','0354095Q','To improve the availability of affordable quality chicks.','<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">The innovation includes a 192 eggs capacity that is Solar powered to reduce overhead costs associated with electricity charges. The innovation also includes a fuel-efficient brooder pot to further reduce brooding costs.</span></span></span>','Lowered the cost of one day chicks by 45% resulting to flock improvement from 6 to 30 birds per member thus increased gross margins.','0','Animal / crop Breeding innovations',4,5,'County ASDSP II offices',NULL,NULL,NULL,16,0,16,4,'169936036120X.jpeg',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-09 13:24:39','1',2211,NULL,'2023-11-07 09:38:42','2023-11-09 10:24:39','430','Kabaru','Delivered to beneficiaries','0','12','0','4','0','Pauline Nyaguthii','+254723164035',NULL,NULL,'The women group was formed in the year 2015 as a merry-round and welfare group. Members were struggling to raise required funds which necessitated starting an income generating activity. They started poultry farming where ASDSP capacity built them on good husbandry practices as well as efficient and effective production and later supported them with solar powered incubator.',NULL),(225,44,'Kahuro-ini Thenge-ini Self-help Group','Thengeini','E0365647.8','S002516.6','192 egg capacity solar powered incubator with brooder pot','1E299782','To improve the availability of affordable quality chicks.','<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">The innovation includes a 192 eggs capacity that is Solar powered to reduce overhead costs associated with electricity charges. The innovation also includes a fuel-efficient brooder pot to further reduce brooding costs.</span></span></span>','Lowered the cost of one day chicks by 55% resulting to flock improvement from 6 to 50 birds per member thus increased gross margins.','0','Animal / crop Breeding innovations',4,5,'County ASDSP II offices',NULL,NULL,NULL,24,5,19,8,'169935801020X.jpg',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-09 13:24:32','1',2211,NULL,'2023-11-07 09:43:56','2023-11-09 10:24:32','168','Iriaini','Delivered to beneficiaries','4','12','1','7','0','Jane Wairimu','+254724994598',NULL,NULL,'The group started in 2006 and was registered in 2007. The group &nbsp;has contributions for merry-go-round and welfare. In 2015 UTaNRMP funded the group and the group has received support from the county government.ASDSPII has given them an innovation, a solar powered 192 egg capacity incubator.&nbsp;',NULL),(226,44,'Kanyoti Farmers Self-help Group','Giakaibei','E0365647.8','S002516.6','192 egg capacity solar powered incubator with brooder pot','766526V0','To improve the availability of affordable quality chicks.','<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">The innovation includes a 192 eggs capacity that is Solar powered to reduce overhead costs associated with electricity charges. The innovation also includes a fuel-efficient brooder pot to further reduce brooding costs.</span></span></span>','Lowered the cost of one day chicks by 55% resulting to flock improvement from 6 to 50 birds per member thus increased gross margins.','0','Animal / crop Breeding innovations',4,5,'County ASDSP II offices',NULL,NULL,NULL,26,13,13,8,'169935801020X.jpg',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-09 13:24:25','1',2211,NULL,'2023-11-07 09:48:46','2023-11-09 10:24:25','168','Magutu','Delivered to beneficiaries','10','8','3','5','0','Evans Wachira','+254724286715',NULL,NULL,'The group started in 2018 &nbsp;with a membership of &nbsp;16 persons . The group majored in poultry farming with an aim to generate income and improve the members welfare.',NULL),(227,44,'Laburra Community Based Organization','Labura','E0365647.8','S002516.6','Feed formulation','9J517797','To improve access to quality feeds and reduce the cost of production.','Feed mill and mixer of one tonne capacity, with 7 tonnes of indigenous chicken feed ingredients, packaging bags, bag closer machine and digital weighing scales.','The Innovation has helped reduce the cost of feeds by 22% i.e. from Kshs 90 to 70 per Kg while maintaining quality feeds. The innovation has created employment for one youth earning a monthly income of Kshs 13,000. The birds have also increased in growth and hatching rate due to consumption of quality feeds.','0','Animal feeding innovations',4,5,'County ASDSP II offices',NULL,NULL,NULL,23,16,7,5,'169936379720X.jpg',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-09 15:28:31','1',2211,NULL,'2023-11-07 10:33:25','2023-11-09 12:28:31','89','Endarasha/Mwiyogo','Delivered to beneficiaries','13','5','3','2','0','Francis Nderitu','0728072069',NULL,NULL,'The group was registered in 2019 with 20 members as a welfare group. The majority of the members were poultry farmers and therefore agreed to engage in the poultry farming business to generate income and be able to support their welfare contributions. ASDSPII capacity built the group on poultry farming and entrepreneurship and later supported them with feed processing equipment.',NULL),(228,25,'Mapema star women group','Gesima','3458\'02.0\"E','046\'05.6\"S','Local vegetable solar drier','827939O1','1. Reduce post-harvest losses from 30% to below 10% especially during rainy season<br />\r\n2. Increase shelf life of processed vegetables<br />\r\n3. Increase value of dried and packaged vegetables from Ksh. 100 to Ksh. 600 per Kg<br />\r\n4. Explore external markets','<span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The innovation is a solar conduction dryer which helps to increase the vegetables shelf life of dried vegetables, reduce post-harvest losses and improves prices of the commodity as well as varied options over choice of markets for their produce.</span></span></span>','1. Increased sales from 2 tonnes to 7 tonnes of vegetables per year with a value of Ksh. 4.2million<br />\r\n2. Improved livelihood of community members due to increased income<br />\r\n3. The community and country is better food and nutrition secure','0','Drying innovations',2,3,'County ASDSP II offices',NULL,NULL,NULL,16,2,14,3,'169954576540X.jpeg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,23,NULL,'2023-11-09 13:15:43','2023-11-09 13:15:43','161','Gesima','Delivered to beneficiaries','2','11','0','3','0','Ibrahim Nyamweya','0722533970',NULL,NULL,'Local vegetables have recorded over 30% post-harvest losses especially during the rainy season when there is glut in the market. This necessitated the Mapema Star group members to develop a proposal on ways of managing post harvest losses by solar drying innovation. Upon their submission, ASDSP II agreed and funded their proposal.',NULL),(229,31,'Senetwo Fish Farm','Senetwo Fish Farm','-0.029274','35.259006','Climate Smart Fish Hatchery Unit','44139L51','<span style=\"font-family:Comic Sans MS,cursive\">The primary goal of the the fish hatchery is to produce and supply high quality fingerlings and fries&nbsp; to fish producers within and beyond the county. The hatchery is a source of income to the group and has created&nbsp;employment opportunities to youth within the locality.&nbsp;</span>','<span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:12pt\">Lack of good quality fingerlings, feed and technical advice; poor market infrastructure and access has attributed to inadequate food nutrition and security.&nbsp;According to ASDSP II, one of the gaps identified by actors in the VC through the Strategic Integrated Value Chain Action Plan (SIVCAP) process was limited supply of fingerlings. &quot;The current demand of fingerlings in the county stands at&nbsp;1,439,560 against a supply of 111,000 produced per year.&nbsp;With the establishment of a new fingerling hatchery in the county that is; unique, efficient, cost effective, climate smart and sustainable in the long run as compared to the conventional fingerling hatcheries, it is positive that the demand gap in fingerling supply shall be bridged. The technology can therefore be easily adopted and replicated by other fish value chain actors.</span></span><br />\r\n&nbsp;','<span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:12.0pt\">It is anticipated that with business skills development, good agronomic practices and market linkages, the innovation will serve</span><span style=\"font-size:12.0pt\">&nbsp;fish </span><span style=\"font-size:12.0pt\">producers to have access to quality fingerlings thereby increasing productivity and contributing to the m</span><span style=\"font-size:12.0pt\">arket demand for traded fish annually.</span></span>','0','Animal / crop Breeding innovations',4,15,'County ASDSP II offices',NULL,NULL,NULL,21,13,8,9,'169954812040X.jpg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2231,NULL,'2023-11-09 13:43:25','2023-11-09 13:43:25','284','Songhor/Soba','Delivered to beneficiaries','8','4','5','4','0','Shadrack Melly','0715285771',NULL,NULL,'<span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:12.0pt\">Fish is not only important for food and nutrition security, but is also one of the solutions to hidden hunger (a micronutrient deficiency of mainly vitamins and minerals that leads to poor nutrition, poor health, reduced productivity and therefore increased poverty and decreased economic growth). Household fish farming improves nutritional status directly through access to fish protein. Integration of fish farming into an already existing agricultural system increases production and overall farm productivity. Substantial gains in the much needed food security and economic growth especially in rural areas have generally not been achieved.</span>In an effort to develop viable innovations for increased fish value chain productivity, improve households income and boost food security, the County Government of Nandi through the ASDSPII&nbsp;Programme&nbsp;undertook&nbsp;various fish farming programmes and projects across the county one of it being the&nbsp;establishment of a fish hatchery and capacity development of value chain actors in Senetwo Fish Farm in Tinderet Sub County.</span>',NULL),(230,35,'KANORERO/KAHUHO SELF HELP GROUP','KANORERO','300','400','Pyrethrum Tissue culture nursery bulking','191V1312','Bulking of pyrethrum Tissue culture material&nbsp; to obtain planting material','Bulking of 5000 pyrethrum Tissue seedlings&nbsp;','Increase in acreage of high quality pyretrum material from zero to 200 acres during the project period. Increase in pyrethrin content of dried flowers from 1%-2%. Increase in income from a Kg of dried flowers from Ksh 230- Ksh 380 per Kg.','0','Value Addition (Processing) innovations',4,24,'County ASDSP II offices',NULL,NULL,NULL,70,38,32,5,'169955431540X.jpg',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-10 08:07:25','2220',2220,NULL,'2023-11-09 15:29:00','2023-11-10 05:07:25','43','ELEMENTAITA','Delivered to beneficiaries','33','32','5','0','0','Phillip Njoroge Kamau','0100705099',NULL,NULL,'Kanorero SHG started in the year 2016 with activities of planting vegetables and merrygo round. The group later started planted pyrethrum in the nursery and selling the splits to other members and farmers in their village. During ASDSP II the group was joint together with Kahuruko which had also newly started in the area ad was also growing pyrethrum. In 2021 The group was issued with pyrethrum tissue culture material which they planted in a bulking nursery plot that they had hired. After four months the group divided the material among themselves and planted in individual farms. Currently the members have about 1/8-1/4 acre of pyrethrum',NULL),(231,25,'Cow milk Value Chain Platform (VCP)','Esise','35o0237.7E','0o4910.6S','East Coast Fever (ECF) Vaccination in dairy cattle','4G046517','Reduce prevalence of ECF disease in dairy cattle from 30% to below 15%','Dairy cattle were vaccinated against East Coast Fever (ECF) disease using the new Infection and Treatment Method (ITM).','Increased income among value chain actors<br />\r\nReduced cost of ECF control from Ksh. 1000 per cow per month to Ksh. 450 per cow per month','0','Animal / crop Breeding innovations',1,2,'County ASDSP II offices',NULL,NULL,NULL,347,207,140,84,'169956170040X.jpeg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,23,NULL,'2023-11-09 17:37:19','2023-11-09 17:37:19','10','Nyansiongo','Delivered to beneficiaries','146','117','61','23','0','Charles Ayoti','0714991934',NULL,NULL,'The innovation aimed to reduce dairy cattle morbidity and mortality',NULL),(232,25,'Nyakongo Livestock Producers Society','Magombo','3468\'02.0\"E','046\'03.6\"S','Mobile milk pre-chiller tanks','761L2981','To reduce milk post-production losses from 20% to below 5% during transportation','This innovation helps significantly to reduce post production losses of milk during transportation','Increased income due to more milk sales','0','Cooling innovations',5,2,'County ASDSP II offices',NULL,NULL,NULL,71,43,28,14,'169956342040X.jpeg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,23,NULL,'2023-11-09 18:02:52','2023-11-09 18:02:52','161','Magombo','Delivered to beneficiaries','35','22','8','6','0','Abel Maroko','0728045914',NULL,NULL,'Milk pre-chillers that are solar powered are mounted on a motorbike for milk transportation',NULL),(233,28,'Destiny Maize Handlers and Marketers Cooperative Society','Kapsitwet Market','33.2344','0.213','Portable Biomass Easy M500 Maize Dryer','816990W0','1.Reduce post harvest losses amongst Destiny Cooperative mambers in maize due to rotting from 30% to 19%<br />\r\n2.Provide an alternative source of income to the cooperative through maize drying services<br />\r\n3.Ensure safe maize to the cooperative members and surrounding community free from aflatoxin','The dryer burns maize cobs as its main heat source,given that the cobs are available on the farm at little to no cost. The heat and smoke produced from burning the maize cobs passes through the heat exchange of the Easy Dry M500 and then out the chimney. a second fan powered by a solar panel pushes clean air through alternative channels in the heat exchange<br />\r\n<br />\r\n&nbsp;','reduced post harvest losses from 30 to 19%<br />\r\nincreased availability of safe maize for consumption and sale<br />\r\nreduced costs of drying maize as it uses solar energy<br />\r\nadditional revenue streams to the cooperative as they dry maize at a cost/price','0','Drying innovations',2,10,'County ASDSP II offices',NULL,NULL,NULL,386,251,135,39,'169956372340X.jpg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2222,NULL,'2023-11-09 18:03:52','2023-11-09 18:03:52','120','Kapomboi','Delivered to beneficiaries','223','124','28','11','0','Stephen Setim','0725593533/0733459732',NULL,NULL,'Post harvest losses in cereals like maize in the county and country at large stands at 30% and at times may go even higher with issues of climate change where maize crop becomes ready for harvesting at a time when there are rains.This forces farmers to look for ways of going around this to reduce the post harvest losses due to rotting.Farmers also incur high costs of drying the maize crop in terms of fees at drying centers like the NCPB facilities and cost of transporting the maize to and from the drying centers. Poorly dried maize becomes a health hazard by exposing the potential consumers to aflatoxin and other health risks',NULL),(235,24,'Kekapu Women Group','Matongo market,','5666','8999','Motorcycle driven Maziwa plus Solar powered pre-chiller of 200 litre capacity','1212038B','To reduce post production losses of milk.<br />\r\nTo reduce adulteration of milk by transporters.<br />\r\n&nbsp;','The solar powered pre-chiller is a chiller unit that offers solution to safe and cooling transportation of milk while on transit. The chilling technology is powered by solar. The chiller is mountable on a motorcycle which enables transportation from one point to another. The chiller is also designed in such a way that milk can be safely and hygienically drawn from the draining tap according to requested quantities by the customers.','After receiving the equipment the group increased their capacity of aggregated and marketed milk to 350-380 liters per day (they received this equipment among other supportive equipment that they received from a stakeholder, KCIC, who supported them with analyzer, pasteurizer, cooler).&nbsp;<br />\r\nThe losses reduced from at least 5-10 liters per day out of 250 liters per day to less than 2 liters per day out of 350-380 liters per day.<br />\r\nThe group attracted 10 (M2; F5; Y3) new customers from the impression they got from seeing the unit and transit, and the advantage of having the milk they want measured and drained for them hygienically.','0','Transportation innovations',2,2,'County ASDSP II offices',NULL,NULL,NULL,28,10,18,5,'169960211650X.jpg',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-10 08:57:56','1',2234,NULL,'2023-11-10 05:12:10','2023-11-10 05:57:56','113','Bogeka','Delivered to beneficiaries','7','16','3','2','0','Monica Ombese','0724128549',NULL,NULL,'The group, Kekapu women group used to experience losses of at least 5-10&nbsp;litres per day from their marketed volumes of 250 litres per day that time. The losses were due to:&nbsp;delays in delivery of milk to potential customers as a result of unreliable transportation networks; and adulteration of customers milk by the transporters (some would&nbsp;mix the milk with river water).&nbsp;',NULL),(236,37,'Kabianga Farmers Cooperative society','Kabianga','1050','28','Animal feed processing equipments','339J0850','<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">The brainchild of the cooperative society and ASDSP Kericho, the innovation aimed to tackle a pressing issue faced by local farmers &ndash; the high cost of animal feeds, particularly dairy meal. With the objective of reducing costs and promoting sustainability, the cooperative society set out to create an efficient and cost-effective solution.</span></span></span><br />\r\n&nbsp;','<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Under Outcome Area One, Component 1.2: Value Chain Innovations with High Prospects for Women and Youth Empowerment, the cooperative society received support for an ambitious project &ndash; the establishment of an animal feeds processing plant.</span></span></span><br />\r\n&nbsp;','<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">The impacts of this innovative venture are tangible and far-reaching. The cost of dairy meal has seen a significant reduction, with a 70kg bag now retailing at Kshs 2750, compared to other brands that go for as much as Kshs 3250. This price reduction directly benefits local farmers and contributes to the overall economic empowerment of the community.</span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Moreover, the processing of feeds has led to a remarkable achievement &ndash; a reduction of Kshs 1 per liter in the cost of milk production. This not only benefits the cooperative society but also has a ripple effect on the entire value chain, empowering farmers accessing the feeds and ensuring a more sustainable and profitable dairy farming venture.</span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Empowering Youth: One of the notable outcomes of this project is the direct employment of six youths in the community. These young individuals are not only gaining valuable work experience but are also actively contributing to the success of the cooperative society. The project stands as a testament to the transformative power of agriculture in providing meaningful employment opportunities for the youth.</span></span></span><br />\r\n&nbsp;','0','Animal feeding innovations',2,2,'County ASDSP II offices',NULL,NULL,NULL,4506,2377,2129,1860,'169960474150X.webp',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-10 08:57:50','1',2239,NULL,'2023-11-10 05:42:14','2023-11-10 05:57:50','6','Kabianga','Delivered to beneficiaries','1166','1480','1211','649','0','Mike Koros','0723902166',NULL,NULL,'<span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Kabianga Farmers&#39; Cooperative Society Limited was established and registered in 1964, located 25 km from Kericho Town in Kericho County. Initially facing losses and competition from the private sector, the cooperative received support from the county government and the ASDSP II initiative to enhance its leadership, management, and overall business operations. This assistance enabled the cooperative to develop a business plan and strategic plan for the period 2021-2025, providing a roadmap for growth and sustainability.</span></span></span>','Transformative'),(237,13,'Jitoni Farmers','Jitoni','-3.989824','39.57689','Solar powered drip irrigation kit under shade net','9710931U','The problem to which the ASDSP II intends to contribute to addressing is over reliance on rainfed agriculture;high cost of production associated with utilization of diesel engine driven irrigation system and emission of carbon from such engines into the atmosphere. The ASDSP II supported the group with a shade net house and a solar powered drip irrigation kit&nbsp; that can reduce the rate of evaporation of the irrigated water and ensure efficient water utilization.<br />\r\n<br />\r\nThe solar powered pump;has not only erased the cost of diesel&nbsp; but also contributed to minimization of carbon emissions associated with diesel driven engines.<br />\r\n<br />\r\nThis interventions contribute to&nbsp;improvement of&nbsp; the income of the households of the group members by producing and selling local vegetables as a business.<br />\r\nThey intend to produce at least&nbsp;&nbsp;800 bunches amaranthus, 800 bunches mnavu, 1600 bunches palak, 1,800kg okra per season and sell for improved livelihoods.This will&nbsp;increase production ad productivity of local vegetables through use of drip irrigation and shade net house.','<span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Footlight MT Light&quot;,serif\">The innovation is a solar powered water pump drip irrigation system under shade net with.&nbsp; Drip irrigation is a method of water application for crop growth in which water is applied directly to the root zone of the plant, eliminating runoff, evaporation and drift thereby conserving water and improving efficiency in water usage. Its estimated that a well-designed and managed drip irrigation system has an efficiency of over 90% as compared to the other irrigation methods.<br />\r\nThe *innovation constitutes a shade net house, water tank , solar pump and a drip kit (all provided by ASDSP) . Water source from river Mtsakuni will be used for vegetable irrigation. The VCAs&nbsp; will source farm inputs from stockists in Mombasa and then grow local vegetables and market at farm gate since the demand for local vegetables is high In the area.</span></span></span></span><br />\r\n&nbsp;','<span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Footlight MT Light&quot;,serif\">Promotion of a solar powered drip irrigation system will improve water use efficiency thus mitigating against water shortage. This will enable the VCAs to produce more vegetables with less water.</span></span></span></span><br />\r\n<br />\r\n<span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Footlight MT Light&quot;,serif\">With drip irrigation technology it will be less labor intensive and&nbsp; allows women to focus on other productive issues.</span></span></span></span><br />\r\n<br />\r\n<span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Footlight MT Light&quot;,serif\">Use of solar power will reduce the cost of pumping water to the reservoir thus increasing the share of revenue. The solar power will also mitigate against climate change that would be occasioned by CO2 emissions.</span></span></span></span><br />\r\n<br />\r\n<span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Footlight MT Light&quot;,serif\">Application of drip irrigation in the local vegetable value chain will increase production at the farm level which will in turn increase farm income. An increase in the farm income will provide capital for investment and therefore trigger the demand for inputs. This will in turn increase productivity thereby increase volumes of local vegetables produced.</span></span></span></span>\r\n<h1 style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Footlight MT Light&quot;,serif\">One of the main challenges affecting VCAs at the production and trading nodes is limited market access and low trading volumes respectively. Increased production will increase the VCAs trading capacity</span>.</span></span></h1>','0','New Category',1,5,'County ASDSP II offices',NULL,NULL,NULL,22,2,20,8,'169960921150X.jpg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2214,NULL,'2023-11-10 06:40:27','2023-11-10 06:40:27','57','Jomvu kuu','Delivered to beneficiaries','1','13','1','7','0','Kakono Mkauma','0718295715',NULL,NULL,'<span style=\"font-size:11pt\"><span style=\"line-height:120%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:120%\"><span style=\"font-family:&quot;Footlight MT Light&quot;,serif\">The Kenya vision 2030 also identifies irrigation as one of the technologies that will revolutionize agriculture through transforming smallholder farmers from subsistence to commercially competitive and profitable investments. The innovation is intended to contribute towards minimization of&nbsp; over reliance on rainfed agriculture and ensure consistency in production &nbsp;through out the year. This contributes to increased production and productivity; and also exploitation of available market opportunities throughout the year. One group ( Jitoni local vegetables ) &nbsp;group is saving kshs 2000/= per day worth of diesel fuel ;this contributes to reduction of &nbsp;production cost.</span></span></span></span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:13.7pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Footlight MT Light&quot;,serif\">The VCO was formed in 2015 and is registered with Social Development, but begun working with located at Jitoni area, Jomvu. The key objective of formation of the group was to engage in crops production with a keen focus on local vegetables and other horticultural crops especially Asian vegetables. Currently, the group members cultivate leafy Amaranthus, black night shade, jute mallow, pumpkin leaves, brinjals, spinach, okra and a number of variety of Asian vegetables such as Karella; Cucumber; bitter melon etc</span><span style=\"font-family:&quot;Palatino Linotype&quot;,serif\">. </span><span style=\"font-family:&quot;Footlight MT Light&quot;,serif\">The group members are also engaged in village saving and lending an initiative of ASDSP II which has served to enable them save and lend loans to members to invest in their various value chain businesses.</span></span></span></span><br />\r\n<br />\r\n&nbsp;',NULL),(238,22,'Kobodo Groundnuts Farmers Co-operative Society Limited','Kamata Village','0000','37','SORGHUM THRESHER','44799Z24','<span style=\"font-size:12pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">To increase sorghum seed/grain production by enhancing the use of sorghum motorized threshers to reduce post-production losses by 2,074 &ndash; 748 men, 917 women, and 409 youth value chain actors by 2025.</span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><strong><span style=\"line-height:115%\">Indicators: </span></strong></span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"line-height:115%\">a) </span><span style=\"line-height:115%\">71,558 metric tons of sorghum seed/grain produced per year.</span></span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"line-height:115%\">b) </span><span style=\"line-height:115%\">Three (3) prototype motorized threshers procured for modification by the youths.</span></span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"line-height:115%\">c) </span>3 youths identified and trained on fabrication, management, and operating the threshers.</span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">1) To increase sorghum seed/grain production by enhancing the use of sorghum motorized threshers to reduce post-production losses by 2,074 &ndash; 748 men, 917 women, and 409 youth value chain actors by 2022.</span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><strong><span style=\"line-height:115%\">Indicators: </span></strong></span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"line-height:115%\">a) </span><span style=\"line-height:115%\">71,558 metric tons of sorghum seed/grain produced per year.</span></span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"line-height:115%\">b) </span><span style=\"line-height:115%\">Three (3) prototype motorized threshers procured for modification by the youths.</span></span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"line-height:115%\">c) </span>3 youths identified and trained on fabrication, management, and operating the threshers.</span></span></span>','Sorghum Threshing Machine','The innovation has enabled the VCOs to earn a gross profit margin of Ksh 27,150/=, per month from one thresher, translating to Kshs 905/= per day, compared to Ksh zero (0) from manual threshing, whereby 5 women manually threshing were paid in kind (5 gorogoros per 90 Kg per day). There is a reduction in Youth and Women Labour man-days to two (2) man-days (persons) against 5 Mondays (5 women) by manual threshing using heavy sticks. The machine has also increased the number of bags threshed per day to 15 bags of 90 Kgs (450 kg/hr) against 1 bag (30 kg/hr) manually, depending on the dryness of grains, thereby lowering the cost of threshing to Ksh 1.50/= from Ksh 11.00/=. Post-production losses were reduced to 10% from 15% due to reduced grain spillage (splashing over), incomplete separation of grains from Chaff, and breakage from heavy manual hammering. The workload has been reduced from the tedious drudgery of manual threshing thus providing more time for women and youth to attend to other on-farm and off-farm activities. The work environment has also been improved, because the machine has reduced the the itchy effect from the sorghum head dust (litho) and respiratory infections, reducing the cost of visiting health facilities. The innovation has been able to directly create employment for six (6) machine operators, earning an average of Ksh 500/= per day. From their earnings, some have been able to clear school fees balance of Ksh 4,000/= and collected his KCSE certificate, and bought one (1) cross-breed heifer at Ksh7000/= &nbsp;and one (1) sheep at Ksh 3000/=. The quality of threshed sorghum grains using the machine has improved compared to the manual threshing using heavy sticks, hence fetching a higher price, of Ksh 200/= to Ksh 250/= per 2 kg tin (gorogoro) for Ksh 100/= the grains with broken grains due to manual threshing, depending on the market and varieties. Improved quality has resulted in contract farming by the World Food Programme (WFP/USAID) and KBL to purchase more than 46 tons of sorghum grains. Improved market prices has resulted in increased production on average from 0.5 acre to 2 acres.','0','Value Addition (Processing) innovations',1,11,'County ASDSP II offices',NULL,NULL,NULL,64,28,36,24,'169960879150X.jpg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2217,NULL,'2023-11-10 06:46:20','2023-11-10 06:46:20','Ndhiwa','Kanyamwa Kologi','Delivered to beneficiaries','14','26','14','10','0','Lucas Otieno Okenga','0726 479 233/0795 580 709',NULL,NULL,NULL,NULL),(239,23,'SYLATIV PAULTRY FARM','ORUBA DIP','-1.063806','34.465997','Milling machines and mixers with starter raw materials','24S75326','<span style=\"font-family:Times New Roman,Times,serif\">To contribute to commercialization, gender inclusion and environmental resilience of the chicken value as an enterprise in Migori county&nbsp;</span>','<span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Chicken feed milling machine and a mixer (500kg and 250kg /hr&nbsp; electric powered&nbsp;respectively)</span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Starter materials (90kg maize, 90kg sunflower seed cake)</span></span><br />\r\n&nbsp;','<span style=\"font-family:Times New Roman,Times,serif\"><span style=\"font-size:12px\">Reduced cost of production by 15% since the VCAs supplement homemade feeds with commercial feeds.VCAs have saved up to Ksh 700 per bag of chick and growers marsh&nbsp;<br />\r\nReduced risk of feed contamination<br />\r\nReduced post-harvest losses by averagely 55% as the waste products from the farms are used to prepare feeds</span></span><br />\r\n<br />\r\n&nbsp;','0','Value Addition (Processing) innovations',2,5,'County ASDSP II offices',NULL,NULL,NULL,20,9,11,15,'169960349150X.jpg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2233,NULL,'2023-11-10 06:54:33','2023-11-10 06:54:33','268','ORUBA RAGANA','Delivered to beneficiaries','1','4','8','7','0','DONALD OCHIENG','+254703277928',NULL,NULL,'<span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">The milling machine will bridge the gap of&nbsp;high cost of chicken feeds&nbsp;in the County and beyond. In an effort to develop viable innovations for increased chicken value chain productivity, improve household&rsquo;s income and boost food security, the County Government of Migori through the ASDSP II&nbsp; is undertaking various chicken farming&nbsp;activities through group approach and SYLATIV&nbsp;poultry farm is one of the beneficiaries that benefited from a miller with a mixer of&nbsp; 0.5MT/HR and 0.25MT/HR respectively. The VCOs&nbsp;mainly ventured in chicks production before the intervention of ASDSP II.</span></span><br />\r\n&nbsp;',NULL),(240,24,'Gesoko SHG','Isecha road, Kisii','5666','8999','Black Soldier Fly farming','7888F425','To reduce the cost of production.<br />\r\nTo improve the quality of feeds for increased productivity.','The Black Soldier fly farming is a Climate Smart Agriculture technology. The Black Soldier flies are reared in specially constructed units. The larvae is harvested and dried, and this is the protein source for the chicken. This is a cheap source of protein for the chicken since the larvae feed on wastes. The innovation is gender and environmental friendly.','The feeding cost reduced from 38.8% &nbsp;to 16.5% by use of the BSFL.<br />\r\nThe&nbsp;maturing period for table meat reduced by 1 month due to high crude protein content and the birds took a shorter period to attain maturity. There was also an increase in the carcass quality as well as quality and quantity of eggs.<br />\r\n&nbsp;','0','Animal feeding innovations',4,5,'County ASDSP II offices',NULL,NULL,NULL,15,5,10,7,'169961004950X.jpg',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-10 09:58:11','2234',2234,NULL,'2023-11-10 06:56:05','2023-11-10 06:58:11','156','Monyerero','Delivered to beneficiaries','2','6','3','4','0','Janet Otwori','0780332831',NULL,NULL,'The highest cost of production in the indigenous chicken industry is from feeds amounting to at least 70%. This affects productivity and profits making the farmers have low incomes. This high cost of feeds is as a result of protein source that are usually costly. Another impediment in the industry is the low quality of the feeds from some feed manufacturers that don&rsquo;t meet the minimum requirements especially the CP value.<br />\r\nDuring one of the trainings scheduled by the ASDSP II Programme for the input suppliers, the beneficiary Mdm. Janet, highlighted the challenge of feed as outlined above. The trainees were enlightened about this innovation of black soldier fly farming, and mdm. Janet decided to attend the training at Lenana to learn more on it, and started the business.','Transformative'),(241,13,'Jitoni  farmers','Jitoni','4.0063S','39.6666E','Vegetable production under drip irrigation using solar powered water pump','97B22213','Conserve the environment by reducing carbon emission to the atmosphere&nbsp;through use of solar powered water pump<br />\r\nConserve water by use of drip irrigation','<h1 style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Footlight MT Light&quot;,serif\">The innovation is a solar powered water pump drip irrigation system under shade net with.&nbsp; Drip irrigation is a method of water application for crop growth in which water is applied directly to the root zone of the plant, eliminating runoff, evaporation and drift thereby conserving water and improving efficiency in water usage. Its estimated that a well-designed and managed drip irrigation system has an efficiency of over 90% as compared to the other irrigation methods.</span></span></span></h1>\r\n\r\n<h1 style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Footlight MT Light&quot;,serif\">The Kenya vision 2030 also identifies irrigation as one of the technologies that will revolutionize agriculture through transforming smallholder farmers from subsistence to commercially competitive and profitable investments.</span></span></span></h1>\r\n\r\n<h1 style=\"text-align:justify\">&nbsp;</h1>','<h1 style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Footlight MT Light&quot;,serif\">Initially, the group was using diesel powered generator to pump water from the river they spent ksh 800 a week on fuel and would supply supply vegetables twice a week in Marikiti. </span></span></span></h1>\r\n\r\n<h1 style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Footlight MT Light&quot;,serif\">Since the implementation of the solar powered pump, the group has had a cost saving of Ksh 3200 a month. The crop lasted two months.</span></span></span></h1>\r\n\r\n<h1 style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Footlight MT Light&quot;,serif\">&nbsp;Use of drip lines and shade net has conserved water and the group is able to supply vegetables comtinously for 3 months and got an income of Ksh 40,000 amont</span></span></span></h1>','0','Information (Weather, Market, Technical) dissemination innovations',1,3,'County ASDSP II offices',NULL,NULL,NULL,22,2,20,8,'169960941250X.jpg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2230,NULL,'2023-11-10 06:58:11','2023-11-10 06:58:11','57','Jomvukuu','Delivered to beneficiaries','1','13','1','7','0','Kakono Mkauma','0718295715',NULL,NULL,NULL,NULL),(242,43,'Kibana banana growers self-help group','Kigumo','S00\'24.637\'','E037\'37.661','Kibana banana aggregation centre','642G9187','The shed provides shelter from direct sun- scorching effect thus maintaining banana quality and safety from adverse weather adversaries. it also provides space for group members meeting to sensitize them on maintenance of banana quality and varieties and volumes demand&nbsp;in the market. It also serves as market outlet since once a farmer delivers banana and it&nbsp; is weighed by the committee, they embark on other issues awaiting payment. the structure improves on group economies of scale and improves price negotiation due to volume availed and banana quality.','The shed is an open structure constructed by metallic post and with corrugated iron roofing for water harvesting and shelter. It is 16m in length, 8m wide and10 m in height with a capacity to aggregate 50 tones of banana .&nbsp; The structure is fitted with water harvesting gutters and a water storage tank of 500litre. It has an office for the group administrative issues and storage of essential group items. shed has a murram floor covering and open space for ease of aggregation of bananas delivered by farmers for market.','The shed has seen the group members increase from 120-198 members who are aggregating an average of 46 tonnes of banana monthly. The bulking of banana has increase price offering from Kes 12/- to 22/- due to volumes availed and banana quality.<br />\r\nThe shed has made banana farming attractive to youth and women in the area&nbsp; leading to another support with banana hardening nurseries that seen the group sell over 1000 TC banana seedlings.<br />\r\nThe sheltering of the aggregated bananas has reduce post harvest loses from 10% to below 5% to the group. The farmers also get sensitized on agronomic practices leading to increase of banana batch weight to an average of 35-40 kg from the low of below 20kg.','0','Value Addition (Processing) innovations',3,4,'County ASDSP II offices',NULL,NULL,NULL,120,55,65,9,'169955987240X.png',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-10 10:08:02','2225',2225,NULL,'2023-11-10 07:07:41','2023-11-10 07:08:02','Runyenjes','Kyeni south','Delivered to beneficiaries','51','60','4','5','0','Elias Gacing\'o','0717381809',NULL,NULL,'Ki bana&nbsp; banana growers self-help group was started in 2014 with 14 members who decided to aggregate their bananas together for collective marketing. in 2018, the group had grown to 120 members and aggregating 20-25 tones of banana fortnightly. however, the group had challenge of post-harvesting losses due sun-scorching of the aggregated banana and other weather adversaries while awaiting transport. It is from this challenge that group made a proposal to ASDSP II for support through construction of an aggregation shed&nbsp; to minimize the post harvest losses that was being experienced, as high has 10%.',NULL),(243,12,'Kulmis Tomato Producers Group','BELA farm','41.781829','4.0743192','solar powered irrigation kit','37917H20',NULL,NULL,NULL,'0','Animal / crop Breeding innovations',1,14,'County ASDSP II offices',NULL,NULL,NULL,20,6,14,4,'169961266750X.jpeg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2215,NULL,'2023-11-10 07:39:32','2023-11-10 07:39:32','Mandera East','Khalalio','Delivered to beneficiaries','4','12','2','2','0','Adan Mohamed','0728927200',NULL,NULL,NULL,NULL),(244,12,'Mandera Butchers Association','Buchedrs Market','3.873807','41.796405','digital weighing machine','03B73609',NULL,NULL,NULL,'0','Value Addition (Processing) innovations',3,13,'County ASDSP II offices',NULL,NULL,NULL,190,145,45,30,'169960647950X.jpg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2215,NULL,'2023-11-10 07:47:37','2023-11-10 07:47:37','150','Township','Delivered to beneficiaries','130','30','15','15','0','Hassan Adan','0720453369',NULL,NULL,NULL,NULL),(245,12,'Mandera East Milk sellers Cooperative','sociaty hall','3.9340568','41.862273','solar powered Freezer','29953D97',NULL,NULL,NULL,'0','Cooling innovations',2,12,'County ASDSP II offices',NULL,NULL,NULL,54,26,28,19,'169960296150X.jpg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2215,NULL,'2023-11-10 07:54:06','2023-11-10 07:54:06','150','Neboi','Delivered to beneficiaries','23','12','3','16','0','Asli Mohamed','0720282844',NULL,NULL,NULL,NULL),(246,19,'ASIRIAM  POULTRY PARK','ASIRIAM POULTRY PARK','00','00','Improved kienyeji chicks','8518O008','Equip farmer groups with skills in brooding<br />\r\nEnable farmers embrace the improved kienyeji poultry which help farmers fetch more income<br />\r\nImprove farmers enterpreneural&nbsp;skills in poultry production','Poultry parks,farmer groups and youth mentors are trained on brooding of 1 day old chicks.The chicks are under brooding for 3 weeks after which they are moved to the outgrower section.Some groups sell off chicks just at brooding,some wait until they mature.','Beneficiaries of improved kienyeji have been able to fetch more income of ksh 1000 per bird in a cycle of 4months compared to previous where they could sell off theirs birds at 6months at a lower price of ks600.<br />\r\nEach youth mentor has moulded others in this industry.One youth has a target of 15 mentees.<br />\r\nMortality of chicks has been reduced from 50% to less than 10% due to skills in brooding.<br />\r\n.','0','Animal / crop Breeding innovations',1,5,'County ASDSP II offices',NULL,NULL,NULL,100,55,45,40,'169961545250X.jpg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2244,NULL,'2023-11-10 08:24:37','2023-11-10 08:24:37','276','CHAKOL SOUTH','Delivered to beneficiaries','30','30','25','15','0','BERNAD ADUNGO','0719460695',NULL,NULL,'More than 50% of farmers in Busia county have been rearing local chicken which takes 6months to maturity.The mature bird is sold at an average price of ksh600.Study from research institutions like KALRO Alupe&nbsp;showed that improved local chicken will take 4 months to mature fetching a price of ksh1,000 per bird.ASDSP11 saw need to empower farmers embrace local kienyeji&nbsp;chicks that has fast growth and high income',NULL),(247,32,'Geta Farmers Cooperative Society','geta','-','-','Silage baling machine','Q8209804','The objective of innovation is to reduce on cost of storage while increasing the duration with altering the nutrient composition of the ensiled material.','Silage baling machine is a machine that compact ensiled silage material making a bale which is wrapped by a UV treated wrapping material which is airtight.','After delivery to beneficiaries,the first two weeks it was able to employ six youths.Two youth&nbsp; were trained on usage and basic maintenance who in turn trained other four.During the first tw weeks,it was able to make 2400 bales each bale with an average weight of 70kgs.Cost per bale is 400 which 300 goes to cooperative to cater for cost of transportation,twine,wrapping material,diesel as well as for machine maintenance while 100 caters for the wages of the youths.','0','Animal feeding innovations',1,2,'County ASDSP II offices',NULL,NULL,NULL,787,361,426,61,'169961938850X.heic',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2245,NULL,'2023-11-10 09:50:02','2023-11-10 09:50:02','98','Geta','Delivered to beneficiaries','337','389','24','37','0','Joel Kanyingi','0720961571',NULL,NULL,'This innvoation was identified by cow milk value chain plaftorm&nbsp;members which is anew modern way of conserving silage.',NULL),(248,35,'RURII YOUNG FARMERS','MARAIGUSHU CENTRE','200','500','Installation of Galvanizes solar powered Pyrethrum Dryer','458356O5','Bulking pyrethrum&nbsp; tissue material to obtain adequate plantig material.','Bulking of 5000 pyrethrum&nbsp;tissue culture seedlings','Avalability of planting material, Increase in income, increased acreage under pyrethrum,','0','Value Addition (Processing) innovations',2,24,'County ASDSP II offices',NULL,NULL,NULL,31,17,14,5,'169961981550X.bmp',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-10 12:57:46','2220',2220,NULL,'2023-11-10 09:57:12','2023-11-10 09:57:46','207','NAIVSHA EAST','Delivered to beneficiaries','14','12','3','2','0','JOSEPH MAGU KAHURA','723579335',NULL,NULL,'Rurie Youth group was formed in the year 2013 with the aim of uplifting the standards of the youth of the members of this group to create employment through farming, empower farmers with modern skills of farming, Table banking and merry go round. Rurie young farmers group started as a youth group but at the moments most members are no longer youths. The group has 28 (MA-14, FA-12, FY-2) members.&nbsp;',NULL),(249,36,'Esukuta Youth Group','Nailare_Olomismis Location','000000001','0000001','Feedlot Technology','936X7873','Reduce fattening period from 1-2 years to 3-4 months with high returns for&nbsp;','<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Beef finishing is the period when beef cattle are fed with high energy and protein rich diets so that they will grow rapidly and add muscle/meat to their frame and optimize fat cover in preparation for slaughter.</span></span></span><br />\r\n<strong><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Process Involved in Feedlotting</span></span></span></strong></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:Wingdings\">&Oslash; </span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Young steers are transferred into feedlot once they reach a weight between 230 to 320 kg. </span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:Wingdings\">&Oslash; </span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Improved Boran can gain this weight in 1-1.5 years of age. </span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:Wingdings\">&Oslash; </span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The weights will vary with breeds.</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:Wingdings\">&Oslash; </span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">They are then confined in the feedlot and fed on high ration diet for a period of 3-6 months depending on the finishing system. </span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:Wingdings\">&Oslash; </span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">They are fed a total mixed ration (TMR) during the entire fattening period.</span></span></span></span></span></span><br />\r\n<br />\r\n&nbsp;','The entry weight is 200kgs and the exit weight after 3 months is currently 300-350kgs depending on the breed of the animal.&nbsp;<br />\r\n&nbsp;','0','Animal feeding innovations',1,16,'County ASDSP II offices',NULL,NULL,NULL,11,6,5,11,'169961433550X.jpg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2235,NULL,'2023-11-10 10:24:56','2023-11-10 10:24:56','288','Kilgoris Central','Delivered to beneficiaries','0','0','6','5','0','Benard Ledama','0728287460',NULL,NULL,'The VCO is situated in Narok County, Transmara West Sub-county, Kilgoris central ward. It has a membership of 11(6M,5F). The group was formed in 2012 with an aim of improving the socio-economic status of the members through beef finishing. The VCOs key activity is fattening emaciated animals(beef) and later sell after attaining market weight of 300-350kgs.&nbsp;',NULL),(250,10,'Naim camel milk group','Garissa town','4.0743192','4.0743192','solar powered Freezer','7307E519',NULL,NULL,NULL,'0','Cooling innovations',2,12,'County ASDSP II offices',NULL,NULL,NULL,25,15,10,8,'169962232250X.png',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2241,NULL,'2023-11-10 10:27:16','2023-11-10 10:27:16','502','Township','Delivered to beneficiaries','11','6','4','4','0','Ahmed Gedi','0728905224',NULL,NULL,NULL,NULL),(251,35,'NAKURU FISH(RECH)','TOP MARKET NAKURU','30','200','Installation of Ice Flake Machine','22W14607','To preserve fish through cooling in order to prevent post harvest losses.','Installation of ice flake machine for fish preservation for trades at Topmarket','Increase income for traders, Promote food and nutrition security through fish consumption, Encourage self employment.','0','Cooling innovations',3,15,'County ASDSP II offices',NULL,NULL,NULL,24,3,21,6,'169962294650X.bmp',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-10 13:42:16','2220',2220,NULL,'2023-11-10 10:41:44','2023-11-10 10:42:16','Nakuru Town East','NAKURU EAST','Delivered to beneficiaries','2','16','1','5','0','PERIS ANYANGO','0722450763',NULL,NULL,'The group was formed in 2009 with a membership of 30 traders who were selling fish at Tomarket Nakuru. The main aim to do table bankoing and merry go round.',NULL),(252,34,'Arabal Chepsae','kimorok','50','302','goat house with does','955042Q0','To do galla goat breeding for upgrading the local breeds','Arabal Chepsae benefited from ASDSP innovation grant. The goat was issued with 8 does,3 bucks and a simple goat house was constructed for them','To increase income within the household and ensure food security','0','Animal / crop Breeding innovations',1,13,'County ASDSP II offices',NULL,NULL,NULL,16,8,8,6,'169962262950X.jpg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2219,NULL,'2023-11-10 10:44:10','2023-11-10 10:44:10','157','marigat','Delivered to beneficiaries','4','6','4','2','0','marusoi','0729937392',NULL,NULL,'Arabal Chepsae group is in marigat sub county, marigat ward. The physical location is kimorok,the group consist of 16 members who do production of goats for sale and merry go round',NULL),(253,36,'Baraka CBO','Dikkir Market','000000001','0000001','Sifted Maize Flour Processing','19676N50','To produce high quality sifted maize flour for increased income, food and nutrition security.&nbsp;','<strong>Maize milling</strong>&nbsp;is the<strong>&nbsp;process</strong>&nbsp;of grinding<strong>&nbsp;maize</strong>&nbsp;into<strong>&nbsp;flour,</strong>&nbsp;which can be used in a variety of food products. The<strong>&nbsp;maize milling process</strong>&nbsp;typically involves cleaning and sorting the<strong>&nbsp;maize,</strong>&nbsp;drying it, and then milling it into<strong>&nbsp;flour.</strong>&nbsp;The<strong>&nbsp;flour</strong>&nbsp;is then<strong>&nbsp;sifted</strong>&nbsp;to remove any impurities and packaged for storage or sale.','From the 5 bags of 90kgs of maize processed, the VCO makes a gross profit of Kes 36,000. When the innovation shall be operating at full potential, the innovation shall generate Kes&nbsp;144,000 per day.','0','Value Addition (Processing) innovations',2,10,'County ASDSP II offices',NULL,NULL,NULL,100,21,79,23,'169962534750X.jpg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2235,NULL,'2023-11-10 11:09:20','2023-11-10 11:09:20','287','Ilkerin','Delivered to beneficiaries','8','69','13','10','0','Ezekiel Kitur','0729039485',NULL,NULL,'The VCO was previously involved in maize trade. ASDSP II trained the VCO on maize value addition and the VCO bought the idea. It made a proposal to ASSP II to be supported with a maize mill equipment that can process sifted maize flour.&nbsp;',NULL),(254,38,'Chelemei Riverside Self Help Group','Chelemei','0.00','0.00','Brooding of day old chicks to one month old','775145K3','-<span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">To enhance supply of quality chicks through acquisition of day old F1 chicks brood and supply as quality starter breeding stock to other actors. </span></span></span>','<span style=\"font-size:10pt\"><span style=\"line-height:12pt\"><span style=\"font-family:&quot;Georgia&quot;,serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The innovation targets to enhance indigenous chicken value chain enterprise through adequate production and supply of quality chicks in Bomet County. </span></span></span></span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Inadequate supply of quality chicks is a major challenge in poultry production in the County as identified in the strategic and integrated value chain action plan (SIVCAP). The current demand stands at 1500,000 mature live birds against a supply of 800</span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">,000 birds per annum. This opportunity will bridge the demand gap in chicken supply to 3600 VCA in the County. </span></span></span><br />\r\n&nbsp;','<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">This venture has brought about a number of opportunities to the community;</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:Symbol\">&middot; </span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Creation of employment to some members who are engaged in poultry activities in the enterprise (brooding etc)</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:Symbol\">&middot; </span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Availability of the good quality breeding stock to the community</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:Symbol\">&middot; </span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Income generation and food and nutrition security to members and community.</span></span></span></span></span></span><br />\r\n&nbsp;','0','Animal / crop Breeding innovations',1,5,'County ASDSP II offices',NULL,NULL,NULL,30,10,20,5,'169962557650X.jpg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,31,NULL,'2023-11-10 11:13:16','2023-11-10 11:13:16','8','Longisa','Delivered to beneficiaries','8','17','2','3','0','Obadiah Mutai','0723413036',NULL,NULL,'<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Chelemei Riveside Self Help group<strong> </strong>is one of the value chain organizations (VCO) in Bomet East sub-county being mentored by ASDSP. It has so far undergone tremendous achievements as recently confirmed and its success is greatly contributed by ASDSP 11. The organization was registered in 2020 and currently has 30 members (8 Men, 17 Women and 5 Youth) with objective of improving their living standard, education of their children and to reduce poverty level. The main activities include; merry go round, table banking, poultry rearing and planting of Bananas</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The<strong> </strong>organization has venture into commercial brooding of chicks from Uzima Ltd (Sasso breeds). Through capacity building from ASDSP the organization has been able to gain skills and knowledge on chicks rearing.</span></span></span></span></span></span><br />\r\n&nbsp;',NULL),(255,18,'Rehoboath Women Group','Ndolia Vilage','34.6521282','0.5707342','Use of Pumis','L6888593','The main objective is to reduce disease causing pathogens in the soils used in Greenhouses for Tomato production thereby enhancing yields and incomes','<span style=\"font-size:12pt\"><span style=\"line-height:114%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\"><span style=\"line-height:114%\">The innovation entails use of pumice in the greenhouse to reduce soil pathogens from accessing the plants. This is to reduce disease and pathogen infestation incidences. Pumice is a volcanic material that is well treated for soil pathogens. The material is covered by polythene paper to enhance solarization.</span></span></span></span></span><br />\r\n&nbsp;','<span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\">- </span><span style=\"font-size:10.0pt\">Reduced incidences of pests, water usage and increased yields (40%)</span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\">- </span><span style=\"font-size:10.0pt\">Increased yields (% to established after the season)</span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\">- </span><span style=\"font-size:10.0pt\">Reduced use of plant protection products (30%)</span></span></span><br />\r\n&nbsp;','0','Animal / crop Breeding innovations',1,14,'County ASDSP II offices',NULL,NULL,NULL,32,13,19,6,'169990479710X.jfif',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2212,NULL,'2023-11-13 18:22:04','2023-11-13 18:22:04','308','Bukembe East','Delivered to beneficiaries','9','17','4','2','0','Damaris N. Wafula','0704254851',NULL,NULL,'<span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">Innovation initiated&nbsp; to reduce soil pathogens and to increase greenhouse productivity. </span></span>',NULL),(257,35,'TEMOKAMU SELF HELP GROUP','MUNGETHO CENTRE','50','700','Pyrethrum Tissue culture nursery bulking','E8481697','Bulk the material to obtain adequate planting material','Pyrethrum Tissue culture seedlings(5000 &nbsp;tissue culture seedlings )','Increased income . &nbsp;improved livelihood','0','Animal / crop Breeding innovations',4,24,'County ASDSP II offices',NULL,NULL,NULL,61,21,40,20,'169994786120X.jpg',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-14 07:45:08','2220',2220,NULL,'2023-11-14 04:44:43','2023-11-14 04:45:08','209','NYOTA','Delivered to beneficiaries','16','25','5','15','0','Michael Mwangi Kimani','0788496318',NULL,NULL,'Temokamu &nbsp;self help&nbsp;group started in 2013. Activities involved in were social welfare, farming of horticultural crops. In 2014 the group was given pyrethrum split by the county which did not do well because the splits were issued late. In 2021 the group was given 5000 seedlings of pyrethrum Tissue culture material. At the moment the group has registered as Temokamu pyrethrum farmers cooperative. each member has about 1/4 acre of pyrethrum.',NULL),(260,35,'AMALO/BAITANY PYRETHRUM FARMERS','Olenguruone','790','600','Pyrethrum Tissue culture nursery bulking','241206L7','Bulk the material to obtain adequate planting material','Pyrethrum Tissue culture seedlings(5000 &nbsp;tissue culture seedlings )','Increased income . &nbsp;improved livelihood','0','Animal / crop Breeding innovations',4,24,'County ASDSP II offices',NUL