eased income . &nbsp;improved livelihood','0','Animal / crop Breeding innovations',4,24,'County ASDSP II offices',NULL,NULL,NULL,35,15,20,2,'169995538120X.jpg',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-14 09:50:20','2220',2220,NULL,'2023-11-14 06:50:07','2023-11-14 06:50:20','222','KIHINGO','Delivered to beneficiaries','14','19','1','1','0','John Kamau','0726718612',NULL,NULL,'Wendo SHG is one of VCOs located in Njoro Sub County, Kihingo ward. The group started in the 2015.The groups has 35 (AF-19, AM-14, MY-1, FY-1)members. The main objectives of the formation of this group was to &nbsp;Plant pyrethrum as the main crop for income generation,table Banking- the group contributed money to a common pool and loaned its members at a low interest rate,Merry go round where the group also contributed money for merry go round and each month &nbsp;a member was given the money to purchase an item the group had agreed on. Cuurrently each member has about 1/4 acre of tissue culture pyrethrum.',NULL),(266,35,'SIGAON SELF HELP GROUP','NESSUIT','563','675','Pyrethrum Tissue culture nursery bulking','571463T6','Bulk the material to obtain adequate planting material','Pyrethrum Tissue culture seedlings(5000 &nbsp;tissue culture seedlings )','Increased income . &nbsp;improved livelihood','0','Animal / crop Breeding innovations',4,24,'County ASDSP II offices',NULL,NULL,NULL,53,40,13,5,'169994786120X.jpg',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-14 10:06:25','2220',2220,NULL,'2023-11-14 07:03:37','2023-11-14 07:06:25','222','NESSUIT','Delivered to beneficiaries','37','11','3','2','0','Charles K. Ngeny','0729268325',NULL,NULL,'Sigaon SHG was started in the year 2020 when they combined with Chumnit group. Theie main aim was to expand pyrethrum acreage which initially they had been given by the county. Their future plan is to &nbsp;form a pyrethrum cooperative society for pyrethrum.',NULL),(267,35,'MUNANDA PYRETHRUM GROWERS','KIRENGERO MUNANDA','547','005','Pyrethrum Tis