mal feeding innovations',4,2,'County ASDSP II offices',NULL,NULL,NULL,83,46,37,17,'169996748520X.jpg',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-15 09:08:26','2220',2220,NULL,'2023-11-15 05:54:57','2023-11-15 06:08:26','43','MBARUK EBURRU','Delivered to beneficiaries','41','25','5','12','0','Joseph Gathuru Mbira','0720812167',NULL,NULL,'Kasambara Dairy started in the year 2013 and registered in 2016 as a Self Help group. Its one of the groups that form Kasambara CBO. The activities they were involved in included rearing and improve their livestock breeds through proper management of their &nbsp;stock. Currently the &nbsp;group market&nbsp;their milk together to KCC and Bahati dairy processors.',NULL),(290,35,'BIDII DAIRY SELF HELP GROUP','SUBUKIA VALLEY ACC&S CHURCH','000','000','Bulking of Protein rich Fodder crops','070N3931','Increase milk production/cow/day. Reduced cost of production. Increased incomes.','Provision of Protein Rich Fodder Crops &nbsp; Seeds and seedlings(277 caliandra,277 tree lucerne,222 lurcaena seedlings,222 mulberry cuttings,72 bracharia splits,4.4kgs desmodium seeds, 3.8 lucerne seeds,5kgs sorghum,50kgs DAP,50kgs CAN,1 litre Infiniti fungicide,1 litre Revus insecticide)','Increased income,enhanced nutrition, employment creation.','0','Animal feeding innovations',4,2,'County ASDSP II offices',NULL,NULL,NULL,26,14,12,7,'169996505620X.jpg',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-15 09:08:43','2220',2220,NULL,'2023-11-15 06:07:31','2023-11-15 06:08:43','266','KABAZI','Delivered to beneficiaries','11','8','3','4','0','Agnes Marindany','0759635338',NULL,NULL,'Bidii self help group was formed in 2018 and registered 2019. The group &nbsp;activities involved include dairy farming and Table banking. The group was issued with &nbsp;fodder material &nbsp;bulking site jointly with &nbsp;Hand in Hand. The group was funded with construction of feed store and a tractor by Hand in Hand. &nbsp;In the future the group will make their own &nbsp;animal feeds and sell to group members and other farmers in Kabazi. They also intent to multiply &nbsp;protein rich fodder to individual farms.',NULL),(292,35,'NJORO FISH FARMERS COOPERATIVE','KIHINGO CENTRE','35.972890','(-0.433070','Culture of Black  solder fly','032962G9','Reduce cost of production . Improve disposal of organic waste. Increaed income.','BSF culturing unit(starter kit,2 green houses,plastic bowls,kitchen scale,weighing scale,organic waste containers,insect nets,15 kgs larvae,600 trays,1 shredder,drying trays, 2 weighing scales).','Increased income, improved nutrition,Employment creation.','0','Animal feeding innovations',4,2,'County ASDSP II offices',NULL,NULL,NULL,61,38,23,19,'170004675030X.bmp',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-15 11:19:32','2220',2220,NULL,'2023-11-15 08:19:16','2023-11-15 08:19:32','222','KIHINGO','Delivered to beneficiaries','26','16','12','7','0','Kamau Muchiri','0706541094',NULL,NULL,'Njoro Fish farmers Cooperative was started in 2016 as a cooperative that wanted to produce and market fish as a group,Train its members on fish farming and be able to get financial assistance as a group.The group was trained by RESSECT on Black solder fly &nbsp;rearing for manure and protein feed for fish. Currently all the members have fish ponds but some do not have liners on their ponds.The group has not yet attained maximum production of fish because of poor feeds while high quality feds available are very expensive. The group also recieved assistance from UWEZO funds.',NULL),(294,6,'KAJIADO FARMERS FEEDLOTERS CO-OPERATIVE SOCIETY LIMITED','Near Kimuka Girls Secondary','1.3551S','36.5972E','CATTLE WEIGHING SCALE','844V1673','Objectives of the Weighing is to enable farmers to maximize profits from the feedlots from identifying the feed conversion rate of every animal, sell animal by&nbsp; body weight hence avoiding exploitation from the middle-men.','Technical specifications for the cattle weighing scale:<br />\r\nCapacity: 1000kgs<br />\r\nLoad-cell: 4 Sensors with&nbsp;Tonne each<br />\r\nModel: BWS indicators C/W animal mode<br />\r\nCage floor: Chequered plate 3mm<br />\r\n2 lockable doors: entrance and exit<br />\r\nMaterial: Steel','The cattle weighing scale enhances maximization of feedlot profit through selling animals per weight.There is an Increment of price of &nbsp;1 animal sold &nbsp;at approximately 75,000 in feedlot compared to and one in free range sold at approximately 45,000 generating an increase of gross margin by 30%. Created employment for 3 youth and 1 woman&nbsp; as service providers and also doing feedlot.','0','Animal feeding innovations',1,16,'County ASDSP II offices',NULL,NULL,NULL,46,45,1,30,'170004743930X.jpeg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2201,NULL,'2023-11-15 08:34:58','2023-11-15 08:34:58','Kajiado West','Ewaso Onkidongi','Delivered to beneficiaries','15','1','30','0','0','Mary Lemanken','0722649967',NULL,NULL,'<span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"line-height:107%\">In Kajiado County,beef cattle are sold subjectively and mostly assessed by non-performance indicators like color. Furthermore, most producers have been rendered price-takers and at the mercy of unscrupulous traders (middlemen) due to the existence of livestock market information asymmetry. Livestock weighing assists in assessing the productive efficiency and growth performance, measuring the correct dose of therapeutic pharmaceutical to treat livestock, determine the correct amount of feed and possible values of live animals.&nbsp;</span><br />\r\nThe use of body measurements is more practical, faster, easier and cheaper especially for those farmers that have access to low capital, with little education and minimum supervision. Moreover, implementation of this innovation will enhance achievement of higher GM as well as protecting farmers from the middle men exploitation.This innovation is also a&nbsp; source of employment to youths and organized groups as service providers through provision of mobile electronic weighing scales to traders and as well as those in feedlot Business.</span></span><br />\r\n&nbsp;',NULL),(296,35,'SOLAI FISH FARMERS SELF HELP GROUP','LAKE SOLAI','36.157103','-0.001842','Restocking of Dam/Lake','114360H4','Increased &nbsp;fish production from lake VCAs. Increased income.','Mixed sex fingerlings(13,333 mixed sex tilapia fingerlings) restocking.','Improved nutrition, increased income,employment creation..','0','Animal / crop Breeding innovations',4,15,'County ASDSP II offices',NULL,NULL,NULL,42,27,15,10,'170005000030X.bmp',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2220,NULL,'2023-11-15 09:25:20','2023-11-15 09:25:20','249','SOLAI','Delivered to beneficiaries','22','10','5','5','0','Allan Changwony','0716921742',NULL,NULL,'Solai fish farmers was started during the ASDSP I. Later the group joint with Lake Solai wetland which was operating in lake Solai in the year 2002 and was doing Ecotourism. In the year 2019 fish was introduced in Lake Solai by the County Government of Nakuru. Later the Lake Solai was given an outboard engine and the boat by the County Government of Nakuru. In 2021 ASDSP II funded the group with fingerlings. Currently the group sales its fish locally and in Nakuru Town at Ponda mali fish market.',NULL),(297,18,'Andy\'s Green Groceries','Aong Kiwanja ndege - Kanduyi Highway, Opposite Blue Waves Hotel','34.5601468','1421.3842524082702','E-marketing','1793Y175','<ol>\r\n	<li>To reduce produce waste through establishment of a marketing system supported by establishment of producer contracts, produce collection and delivery mechanism through electronic means</li>\r\n	<li>Increasing market efficiency through establishment of an order management system</li>\r\n	<li>Increase employment of youth through involvement in the business</li>\r\n</ol>','<h1 style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\">The innovation purposed to increase profitability and reduce wastage in the tomato value chain. E-marketing intended to bridge the gap between demand and consumption by linking the business to farmer groups the undertake production and the consumers in Bungoma town. Through the online platforms marketing activities are conducted and orders made and managed. Thereafter there are deliveries to the consumer doorsteps at a service cost.</span></span></span></h1>','<div style=\"text-align:justify\">Reduced disease incidences in Tomato from 30% to 10% and one tomato plant &nbsp;production increased from 7kg &nbsp;to 15kg per season. .Use of Insect traps has reduced use of insecticides which used to cost sh3000 now costing sh1000 ,also reduced air pollution.3000(1200 Male,900 Females,600 male Youth and 300 Female Youth)in &nbsp;VCAs have benefited &nbsp;in the trainnings. 20M, 66 F,122My and 90 FY &nbsp;have gotten jobs in trasportation ,management practices ,granding and sorting.VCA gave land for use, AFA (HCD) and &nbsp;AGRISCOPE &nbsp;trainned &nbsp;VCAS and 1000 VCAs .(300M,400 YM,100 YM,200YF)</div>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\">Increased income by 30%</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\">Reduced produce wastage by 20%</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\">Reduced human labor by 40%</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\">Stable prices through contracts</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\">Improved client management through the website and social media platforms</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\">Growth in customer base by 50%</span></span></span></li>\r\n</ul>','0','Information (Weather, Market, Technical) dissemination innovations',3,14,'County ASDSP II offices',NULL,NULL,NULL,19,10,9,12,'169990479710X.jfif',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2212,NULL,'2023-11-15 16:33:18','2023-11-15 16:33:18','Kanduyi','Township','Delivered to beneficiaries','3','4','7','5','0','AnrWekunda','0702936920',NULL,NULL,'<h1 style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\">The innovation purposed to increase profitability and reduce wastage in the tomato value chain. E-marketing intended to bridge the gap between demand and consumption by linking the business to farmer groups the undertake production and the consumers in Bungoma town. Through the online platforms marketing activities are conducted and orders made and managed. Thereafter there are deliveries to the consumer doorsteps at a service cost.</span></span></span></h1>',NULL),(298,35,'PONDA MALI FISH MONGERS SELF HELP GROUP','PONDA MALI FISH MARKET','36.062719','-0.307927','Installation of Solar powered Freezer','962L8776','Reduction in post production losses and operational costs.','Installation of Solar powered freezer( one freezer , eight solar panels and one inverter).','Increased income, reduction in post production losses,employment creation.','0','Cooling innovations',3,15,'County ASDSP II offices',NULL,NULL,NULL,159,14,145,54,'170011469540X.jpg',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-16 06:18:55','2220',2220,NULL,'2023-11-16 03:18:37','2023-11-16 03:18:55','610','RHONDA','Delivered to beneficiaries','10','95','4','50','0','Laban Musera','0721358600',NULL,NULL,'Ponda Mali / Umbrella Self Help group started in 2013 with a membership of 150.The group meets every Tuesday &nbsp;for Table banking and issue members with the loans. The group also has a group account at KCB&nbsp;Nakuru and individual accounts with &nbsp;Vision Africa SACCO.The group was issued with a solar powered freezer which they use to store fish and sell later when the market is available.',NULL),(299,35,'KORABARIET SELF HELP GROUP','KORABARIET NEXT TO TUMOIYOT PRIMARY','35.47998','- 0.35049','INSTALLATION OF GALVANIZED SOLAR POWERED PYRETHRUM DRYER','0767997D','Proper drying of pyrethrum flowers in order to increase the pyrethrin content.','Installation<em>&nbsp;</em>of<em>&nbsp;</em>a&nbsp;Galvanized solar powered pyrethrum dryers( 1 green house dryers with2&nbsp; solar panels each 340 watts and 1 battery)','Increase income, Employment creation','0','Drying innovations',2,24,'County ASDSP II offices',NULL,NULL,NULL,56,35,21,11,'170011690840X.bmp',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2220,NULL,'2023-11-16 04:20:46','2023-11-16 04:20:46','609','KIPTORORO','Delivered to beneficiaries','30','15','5','6','0','DAVID KOECH','0720887853',NULL,NULL,'Korabariet SHG started in 2015 with the&nbsp; groups main activities being planting potatoes and doing table banking. In 2017, they were issued&nbsp; with pyrethrum seedlings by KENTEGRA&nbsp; Company.. Recently ASDSP II issued the group with a solar powered pyrethrum Dryer.&nbsp;',NULL),(300,35,'SAKI YOUTH GROUP','SACHANGWAN CENTRE','35.937201','0.081678','Installation of Solar powered milk chilling tank.','E1687013','Increase income from cowmilk sales ; increase market segments for cowmilk.','Installation of Solar powered milk chilling tank 1000 litres capacity( with 4 batteries, 8 solar panels @340 watts.','Increased income, improved milk hygiene.','0','Food/Product safety innovations',3,2,'County ASDSP II offices',NULL,NULL,NULL,14,2,12,8,'170012217840X.jpg',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-16 08:55:40','2220',2220,NULL,'2023-11-16 05:12:57','2023-11-16 05:55:40','185','MOLO','Delivered to beneficiaries','2','4','0','8','0','WESLEY','0710259706',NULL,NULL,'Saki Youth group was started in 2012 as a youth but with time some of them are no longer youths. The main activities of the group were goat rearing, training on fodder establishment and feeding of livestock, table banking and merry go round.Currently they own a milk Shop at Sacchangwan centre where they sell milk to the community.',NULL),(301,6,'KAJIADO LIVESTOCK MARKETING COOPERATIVE SOCIETY','Ilbisil','-2.1393840 S','36.8214760 E','Chisel ploughs (In-Line and Rip on Row )','747S4021','<span style=\"font-size:12px\">The main objective of the innovation is to increase pasture yields and acreage,reduce soil erosion and conserve rangelands.</span>','<span style=\"font-size:12px\">1. Number of Tines:&nbsp;<br />\r\nRip on row- 6 tines with rollers<br />\r\nIn-line-4 tines<br />\r\n2.&nbsp;Tines points-Reversible<br />\r\n3. Tines and rollers are all adjustable across toolbar to suite different crop widths<br />\r\n4. Tractor HP required -Apooroximately 20HP per tine</span><br />\r\n&nbsp;','<span style=\"font-size:12px\">Number of hay bales per acre Increased from approximately 100-150 bales to approximately 500 bales per acre. Income per bale increased from Ksh 200 to &nbsp;Ksh 300 creating more market to the existing markets. Increased in gross income Ksh 30,000 to Ksh 150,000 per acre. Creates employment for 5 youth. Increase in Acreage under pasture pasture production from Averagely 1 acre to 5 acre. Increase in income By 50% for the VCO as they Plough land for the Non-members hence ensure sustainability of the Innovation</span>','0','Animal feeding innovations',1,16,'County ASDSP II offices',NULL,NULL,NULL,567,252,315,180,'170012440640X.mp4',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2201,NULL,'2023-11-16 05:48:07','2023-11-16 05:48:07','Kajiado Central','Matapato North','Delivered to beneficiaries','152','235','100','80','0','PAUL MELIARA','0722541057',NULL,NULL,'<span style=\"font-size:12px\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"line-height:150%\">Beef cattle in the county are mainly range-fed with the main feed component being natural pastures. Cyclical droughts and rangeland degradation due to overstocking and invasive weeds have reduced rangeland/pasture productivity over time and resulted in reduced beef cattle productivity evidenced by reduce weight gains, low reproduction and increased diseases and pest infestation.</span></span></span><br />\r\n<span style=\"font-family:&quot;Times New Roman&quot;,serif\">Innovations identified to increase pasture productivity were improved range pasture seeds and commercial bulking of pasture seeds as a women enterprise to ensure continuous and sustainable supply of improved pasture seeds in the county</span></span>',NULL),(302,6,'KAJIADO LIVESTOCK MARKETING COOPERATIVE SOCIETY','Ilbisil','-2.1393840 S','36.8214760 E','Grass seeder','329374M1','The main objective of the innovation is to reduce production cost and time spent in planting,increasing&nbsp; pasture yields and acreage hence reducing dependence on natural pastures','<span style=\"font-size:12px\">The grass seeder has a ribbon auger across the base of the seed box that augers the seed into the center of the box.&nbsp;<br />\r\nIt has an agitator shaft in the seed box that stops the seed from bridging.<br />\r\nThe grass seed then drops into the pipe which is then sucked into a specially constructed PTO driven fan. The fan then blows the seed into the distributor head and down 12 pipes to a spreader plate. The spiral roller the&nbsp;presses the grass seed into the soil.</span>','Increase pasture yields and acreage coverage<br />\r\nCreates employment opportunities for the VCO<br />\r\n&nbsp;','0','Animal feeding innovations',1,16,'County ASDSP II offices',NULL,NULL,NULL,567,252,315,180,'170012632340X.jpeg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2201,NULL,'2023-11-16 06:19:22','2023-11-16 06:19:22','61','Matapato North','Delivered to beneficiaries','152','235','100','80','0','PAUL MELIARA','0722541057',NULL,NULL,'<span style=\"font-size:12px\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"line-height:150%\">Feed constitute the largest component of production cost in any livestock enterprise. Beef cattle in the county are mainly range-fed with the main feed component being natural pastures. Cyclical droughts and rangeland degradation due to overstocking and invasive weeds have reduced rangeland/pasture productivity over time and resulted in reduced beef cattle productivity evidenced by reduce weight gains, low reproduction and increased diseases and pest infestation.</span></span></span><br />\r\n<span style=\"font-family:&quot;Times New Roman&quot;,serif\">Innovations identified to increase pasture productivity were improved range pasture seeds and commercial bulking of pasture seeds as a women enterprise to ensure continuous and sustainable supply of improved pasture seeds in the county</span></span>',NULL),(304,6,'Masai Youth Empowerment Group','Ewuaso Kedong','36.479','-1.655','GreenHouse Plant Raiser','R8820084','<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:Wingdings\">&uuml; </span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Promote higher germination rate of 85-90%</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:Wingdings\">&uuml; </span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Reduced incidences of soil borne diseases and other pests</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:Wingdings\">&uuml; </span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Increased production of better quality tomatoes, better markets thus increased income</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:Wingdings\">&uuml; </span></span></span><em><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\">Grow and maintain a large number of seedlings per unit area</span></span></em><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">.</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:Wingdings\">&uuml; </span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Improved root development hence reduced incidences of transplanting shock</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:Wingdings\">&uuml; </span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Promote faster and uniform germination</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:Wingdings\">&uuml; </span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Dedicated space for different seedling varieties</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:Wingdings\">&uuml; </span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Source of income to the beneficiaries</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:Wingdings\">&uuml; </span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Enhance entrepreneurial skills, hence create employment</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:Wingdings\">&uuml; </span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Reduced environmental degradation, improved water use efficiency and reduction in environmental pollution through use recyclable seed trays</span></span></span></span></span></span><br />\r\n&nbsp;','<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The greenhouse size is 8m* 15m.The structure is covered with a yellow greenhouse polythene of 200 microns and a white insect net on the side. &nbsp;Its fitted with 8 metal tables each measuring 2m*1.5m to hold the propagation trays. Each table can hold 9 seedling trays of each with 200 holes capacity. At full capacity the plant raiser can propagate 14,400 seedlings. The plant raiser is fitted with a complete mist irrigation system hence no manual irrigation.</span></span></span></span></span></span><br />\r\n&nbsp;','<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The plant raiser has promoted use of disease free and healthy seedlings. Use of plant raisers have promoted green growth through reduction of GHG and pollution by use of recyclable trays. The misters used in watering have reduced labour requirement and water conservation.100% germination percentage has reduced loses (20%) encountered in ordinary propagation. Since its gender friendly, women and youth participation has improved the performance of the innovation since they are the main work force. The ripple effect has been increased enterprise profitability. Youth have been employed both casual and permanent basis.</span></span></span></span></span></span><br />\r\n&nbsp;','0','Animal / crop Breeding innovations',4,14,'County ASDSP II offices',NULL,NULL,NULL,20,9,11,5,'170013472640X.jpeg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2202,NULL,'2023-11-16 08:43:12','2023-11-16 08:43:12','63','Ewuaso Kedong','Delivered to beneficiaries','6','9','3','2','0','Philip Patwan','0720212263',NULL,NULL,'<span style=\"font-size:12pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Horticulture farmers face a challenge in raising healthy seedlings using convectional seed nursery. Seedlings require a lot of care and the right conditions before they can be transplanted. Inconsistent watering, non-optimal temperatures, soil borne pests and other seedling management malpractices have demonstrated poor germination of low-quality seedlings thus realizing minimal profit margins. However, with modern technology, there is a need to fill the gap through embracing innovations in seedling propagation so as to ensure high quality seedlings so as to get maximum returns.</span></span></span><br />\r\n&nbsp;',NULL),(306,6,'Masai Youth Empowerment Group','Ewuaso Kedong','36.479','-1.655','Open Field Drip Irrigation Kit','1313377G','<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:Wingdings\">&uuml; </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">To increase tomato production through the use of effective and efficient of water saving technologies</span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:Wingdings\">&uuml; </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">To reduce risk of water loss through use of modern technologies for effective and efficient water use in irrigation&nbsp;</span></span></span></span></span><br />\r\n&nbsp;','<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">1/4 open field &nbsp;irrigation kit.</span></span></span></span></span></span><br />\r\n&nbsp;','<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Increased crop productivity through the use of effective and efficient of water saving technologies. Reduced risk of water loss through use of modern technologies for effective and efficient water use in irrigation. Women and youth who are the main workforce will adopt the technology since its gender friendly.</span></span></span></span></span></span><br />\r\n&nbsp;','0','Production',1,14,'County ASDSP II offices',NULL,NULL,NULL,20,9,11,5,'170013795440X.jpeg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2202,NULL,'2023-11-16 09:48:37','2023-11-16 09:48:37','63','Ewuaso Kedong','Delivered to beneficiaries','6','9','3','2','0','Philip Patwan','0720212263',NULL,NULL,'<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Water deficit is the most important environmental factor limiting horticultural yields. In the ASAL areas, farmers have chronically faced drought due to poor /erratic rainfall .This has resulted in chronic tomato failure to those farmers that solely rely on rainfall. If irrigated, these areas can have a high yield potential because of the high solar radiation, favourable day and night temperature and low atmospheric humidity, conditions that decrease the incidence of pests and diseases compared to areas in temperate zones. The key to maximizing tomato yields per unit of supplied water in dry lands is ensuring that as much as possible of the available moisture is used through plant transpiration and as little as possible is lost through soil evaporation and deep percolation.</span></span></span></span><br />\r\n&nbsp;',NULL),(307,6,'KAJIADO LIVESTOCK MARKETING COOPERATIVE SOCIETY','Ilbisil','-2.1393840 S','36.8214760 E','HAY MOWER','P2553725','<span style=\"font-size:12px\">The objectives of the innovation are:</span>\r\n<ol>\r\n	<li><span style=\"font-size:12px\">Reduce production cost as there is no use of other implements such as rake as its combined.</span></li>\r\n	<li><span style=\"font-size:12px\">Reduce post-harvest losses from the harvesting</span></li>\r\n</ol>','<ol>\r\n	<li><span style=\"font-size:12px\">Has one large&nbsp; diameter swinging heavy duty blade which cuts grass and leaves it in a swath ready for bailing</span></li>\r\n	<li><span style=\"font-size:12px\">Unlike other mowers,this mower leaves the grass in a fluffed up enabling it to dry out fast&nbsp;</span></li>\r\n	<li><span style=\"font-size:12px\">Cutting heights is controlled with a castor wheel at the rear of the machine</span></li>\r\n	<li><span style=\"font-size:12px\">Width cut is at 108``</span></li>\r\n	<li><span style=\"font-size:12px\">HP required is 60HP</span></li>\r\n	<li><span style=\"font-size:12px\">PTO drive to gear box then belt drive to rotors</span></li>\r\n</ol>','<ol>\r\n	<li><span style=\"font-size:12px\">More bales are obtained from one acre as there reduction in post harvest losses.</span></li>\r\n	<li><span style=\"font-size:12px\">Provision of employment for the youth as its more effecient and ieffective</span></li>\r\n</ol>','0','Animal feeding innovations',1,16,'County ASDSP II offices',NULL,NULL,NULL,567,252,315,180,'170012891440X.jpeg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2201,NULL,'2023-11-16 11:07:58','2023-11-16 11:07:58','Kajiado Central','Matapato North','Delivered to beneficiaries','152','235','100','80','0','PAUL MELIARA','0722541057',NULL,NULL,'<span style=\"font-size:12px\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Pasture conservation is one of the flagship projects for the County government (CIDP 2018-2022). Pasture establishment, harvesting and conservation innovations will be supported to enhance drought preparedness. These innovations were: chisel ploughs, mechanized grass mowers, mechanized rakes and mechanized hay balers. These equipment are more efficient as compared to the existing equipment as large tracts of pasture land a characteristic of Kajiado can be established, harvested and conserved in optimal time.</span></span>',NULL),(308,35,'KAPCHOORWA YOUTH GROUP','KAPCHORWA CENTRE','35. 41 25596\"E','0.36 19902\"S','Pyrethrum Tissue culture nursery bulking','4707M920','Bulk the material to obtain adequate planting material.','Pyrethrum Tissue culture seedlings(5000 &nbsp;tissue culture seedlings)','Increased income . &nbsp;improved livelihood.','0','Animal / crop Breeding innovations',4,24,'County ASDSP II offices',NULL,NULL,NULL,16,2,14,12,'170020542050X.jpg',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-17 09:37:13','2220',2220,NULL,'2023-11-17 04:27:36','2023-11-17 06:37:13','608','AMALO','Delivered to beneficiaries','2','2','0','12','0','Joyce Koech','0729144100',NULL,NULL,'Kapchorwa youth group was started in 16 members (AM-2, FY-12 FA-2) The Group started in the year 2010 with the objectives of rearing poultry and planting Pyrethrum. Currently every member has &frac14;-1/2 acres of pyrethrum which is in production stage.&nbsp;',NULL),(309,35,'KOISEGUT WOMEN GROUP','AINAMOI','35. 39 52062\"E','0. 33 02 718\"S','Pyrethrum Tissue culture nursery bulking','0778Q669','Bulk the material to obtain adequate planting material.','Pyrethrum Tissue culture seedlings(5000 &nbsp;tissue culture seedlings).','Increased income . &nbsp;improved livelihood.','0','Animal / crop Breeding innovations',4,24,'County ASDSP II offices',NULL,NULL,NULL,23,8,15,3,'170020636450X.jpg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2220,NULL,'2023-11-17 04:48:23','2023-11-17 04:48:23','608','KIPTAGICH','Delivered to beneficiaries','7','13','1','2','0','Emily Langat','0728132723',NULL,NULL,'Koisegut women group started in 1994 as a women group. Their major activities were construction of water tanks for each member and planting of Horticultural crops such as potatoes and garden peas. The group was issued with 7000 tissue seedlings for bulking which they divided among the members and also gave to Kiptagich Self help group. Currently each member has about 1/4 an acre which is c ready for picking and they sell to KENTEGRA.',NULL),(310,35,'BAHATI FARMERS COOPERATIVE','KARUNGA - CHANIA CHIEF\'S OFFICE','36.160332','-0.17764','Pyrethrum Tissue culture nursery bulking','783C7768','Bulk the material to obtain adequate planting material.','Pyrethrum Tissue culture seedlings(5000 &nbsp;tissue culture seedlings )','Increased income . &nbsp;improved livelihood','0','Animal / crop Breeding innovations',4,24,'County ASDSP II offices',NULL,NULL,NULL,33,25,8,7,'170020823450X.jpg',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-17 09:36:48','2220',2220,NULL,'2023-11-17 05:15:27','2023-11-17 06:36:48','209','BAHATI','Delivered to beneficiaries','20','6','5','2','0','Dominic Murumba','0723246923',NULL,NULL,'Bahati farmers&#39; cooperative was started in the year 1968 with the aim of producing pyrethrum and milk and market together asa group. When the milk sector was liberalized the farmers started selling milk to brokers after they fished paying of their loans. Pyrethrum production stopped when &nbsp;PPCK went under with farmers money. Later the group was revived in 2014 with ASDSP I but picked well on pyrethrum production in 2021 when they were issued with pyrethrum tissue culture material. Members have 1/4-1 acre land under pyrethrum which the sell individually to KENTEGRA. The cooperative has a 3/4 of land under tissue culture nursery which the sell to members.',NULL),(311,35,'RAFIKI SELF HELP GROUP','KIHEO AIC','35.4350E','-0.1852S','Pyrethrum Tissue culture nursery bulking','57D40458','Bulk the material to obtain adequate planting material.','Pyrethrum Tissue culture seedlings(5000 &nbsp;tissue culture seedlings )','Increased income . &nbsp;improved livelihood.','0','Animal / crop Breeding innovations',4,24,'County ASDSP II offices',NULL,NULL,NULL,53,32,21,15,'170021079650X.jpg',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-17 09:36:31','2220',2220,NULL,'2023-11-17 05:48:53','2023-11-17 06:36:31','185','TURI','Delivered to beneficiaries','27','11','5','10','0','Peter Waweru Muchiri','0722354455',NULL,NULL,'Rafiki Pyrethrum Growers was formed in 2016 as a self help group. The main activities involved table banking, merry go round and farming of pyrethrum, potatoes and maize.The group was issued with 5000 plantlets of pyrethrum tissue material &nbsp;which the y bulked together as a group and split the group after 4 months and divided among the group members . Currently each member has about 1/8 of an acre of tissue culture material.',NULL),(312,35,'EBURRU MBARUK( EBSO)','EBURRU CHIEF\'s CAMP','36.2415831','-0.6188755','Pyrethrum Tissue culture nursery bulking','82902W95','Bulkpyrethrum Tissue Culture&nbsp; material to obtain adequate planting material.','Bulking of Pyrethrum Tissue culture seedlings(5000 &nbsp;tissue culture seedlings).','Increased income . &nbsp;improved livelihood.','0','Animal / crop Breeding innovations',4,24,'County ASDSP II offices',NULL,NULL,NULL,146,67,79,49,'170021328650X.jpg',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-17 09:36:03','2220',2220,NULL,'2023-11-17 06:29:39','2023-11-17 06:36:03','43','EBURRU MBARUK','Delivered to beneficiaries','52','45','15','34','0','Daniel Maina Mwangi','0724361853',NULL,NULL,'Eburru Baruk(EBSO) was initially formed as a group &nbsp;of farmers in 2018. Initially they were farming potatoes and pyrethrum and at the same time engaging in merry go round as a way of raising capital for their farming activities. Currently the group as is involved in bee keeping and poultry farming where they formulate feeds for Kienyeji layers and sell to i&#39;ts members.',NULL),(315,35,'KIMKASA/KENYATTA DAM',NULL,'35.53008','-0.29918','Restocking of Dam/Lake','77S12226','Increased &nbsp;fish production from dam. Increased income.','Mixed sex fingerlings (13,333 mixed sex tilapia fingerlings).','Increased income,enhanced nutrition, employment creation.','0','Animal / crop Breeding innovations',4,15,'County ASDSP II offices',NULL,NULL,NULL,104,70,34,30,'170004773630X.jpg',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-17 12:39:20','2220',2220,NULL,'2023-11-17 09:38:54','2023-11-17 09:39:20','609','NYOTA','Delivered to beneficiaries','54','20','16','14','0','Edward Bett','0721659511',NULL,NULL,'Kimkassa / Kenyatta &nbsp;group started as Kimkasa in 2018 and later in 2020 merged with members of Kenyatta due to the sharing of the Dam. The group had a small pond of which all the members were sharing the proceeds.Two species of fish are present in the dam i.e mud fish and Tilapia.The catch from &nbsp;the dam is 80-100 pieces/harvest done three times a week. The price of fish is about 120-250 /piece of tilapia and 150 per piece of mud fish.The marketing channel is mainly the &nbsp;dam beach,neighbouring markets and hotels.',NULL),(316,35,'KIMKASA/KENYATTA DAM','KENYATTA DAM,MUNGETHO CENTRE','35.53008','-0.29918','Procurement of outboard engine','959155C6','Increase in fish catch, Promote Ecotourism on the dam.','Procurement of outboard engine(1 outboard engine).','Employment creation, improved mobility, increased income.','0','Transportation innovations',5,15,'County ASDSP II offices',NULL,NULL,NULL,104,70,34,30,'170004782930X.bmp',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-17 12:47:22','2220',2220,NULL,'2023-11-17 09:46:05','2023-11-17 09:47:22','609','NYOTA','Delivered to beneficiaries','54','20','16','14','0','Edward Bett','0721659511',NULL,NULL,'Kimkassa / Kenyatta &nbsp;group started as Kimkasa in 2018 and later in 2020 merged with members of Kenyatta due to the sharing of the Dam. The group had a small pond of which all the members were sharing the proceeds.Two species of fish are present in the dam i.e mud fish and Tilapia.The catch from &nbsp;the dam is 80-100 pieces/harvest done three times a week. The price of fish is about 120-250 /piece of tilapia and 150 per piece of mud fish.The marketing channel is mainly the &nbsp;dam beach,neighbouring markets and hotels.',NULL),(317,33,'Loosuk  Hay and Feedlot farmers','Loosuk trading center','36 34\' 42\" E','1 0\' 29\" N','Loosuk  Yay and Feedlot','1803V633','<ul>\r\n	<li><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">To increase productivity and profitability of the beef value chain&nbsp;</span></span></li>\r\n	<li><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">To improve incomes for the beef VC actors&nbsp;</span></span></li>\r\n	<li><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">To ensures inclusivity, especially involvement and participation by women, youth&nbsp; and special groups in the Beef VC development processes</span></span></li>\r\n	<li><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">To increase market competitiveness for beef products from Samburu county by meeting the quality and quantity demanded by the markets</span></span></li>\r\n</ul>','<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,&quot;sans-serif&quot;\">Beef Cattle feedloting/fattening involves the feeding of beef cattle with a protein balanced, high-energy diet for a period of 90 days under confinement to increase live weights and improve degree of finish and thus obtain better grades at the abattoir and better prices at the target markets . Beef cattle fattening enables the cattle to express fully their genetic potential for growth. Cattle fattening is not only a lucrative business but also plays a vital role in meeting the ever-growing global demand for high-quality beef.&nbsp; A feedlot project is gender responsive project which ensures that inclusivity especially involvement and participation by women and youth in beef VC development process by overcoming the limitations related to access to, socio-cultural issues and decision making process in relation to the Beef VC. the loosuk hay and pasture feedlot has a carrying capacity of 200 Beef cattle at a go.&nbsp;</span></span></span><br />\r\n&nbsp;','<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,&quot;sans-serif&quot;\">The feed lot provides employment of 5 youths who work in the facility on daily basis. It has also provided a reliable market for livestock from the surrounding community.</span></span></span><br />\r\n&nbsp;','0','Production',1,16,'County ASDSP II offices',NULL,NULL,NULL,194,90,104,64,'170031735160X.jpg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,21,NULL,'2023-11-18 11:25:32','2023-11-18 11:25:32','253','Loosuk','Delivered to beneficiaries','50','80','40','24','0','Christine Letunta','0723753799',NULL,NULL,'<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,&quot;sans-serif&quot;\">Loosuk hay and Feedlot farmers was established by members to address the challenge of livestock loss due to persistent drought situation and cattle rustling. During dry periods, the group members, just like any other pastoralist engaged in moving their livestock from one place to the other in search for pasture and water, which comes with enormous challenges and losses. in 2014 the group was established with a purpose of producing pasture for their livestock, which was very successful. The group members have undergone various training, coaching and mentorship and&nbsp; educational visit and cross learning sessions from ASDSP II and its collaboraters in the agricultural sector in samburu county. Represenatives of the group were supported by ASDSP II to participate in a feedlot conference organized&nbsp; Feedlot farms in&nbsp; Kajiado County which became an insightful to the group. As a&nbsp; result, the group members agreed to upgrade here strategy form pasture production to include a feedloting system.&nbsp; Feedloting presents a golden opportunity for aspiring cattle farmers to step into the industry and contribute to the supply of premium-quality beef products.</span></span></span><br />\r\n&nbsp;',NULL),(318,33,'Lolmolog cereals farmers cooperative Ltd','Lolmolog dispensary','36.5877948','0.927041','Lolmolog cereals farmers cooperative Ltd','219505F8','<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Increased efficiency. Use of maize motorized sheller help to save time and resources compared to manual shelling methods.<br />\r\nImproved productivity.By use of motorized maize sheller can handle&nbsp;larger quantities&nbsp; of maize and shell kernels&nbsp;at a faster pace, resulting in higher overall productivity.<br />\r\nAdaptability and versatility; motorized maize sheller&nbsp;often&nbsp;aims to be adaptable&nbsp;to different&nbsp;maize varieties and sizes.&nbsp;<br />\r\nIt enhanced kernel quality because&nbsp;the machine&nbsp;is designed to ensure&nbsp;that the sheller process is performed with minimal damage to the kernels.&nbsp;</span></span></span><br />\r\n&nbsp;','<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Maize motorized sheller machine is powered by 7.5hp petrol engine was delivered to Lolmolog&nbsp;cereal cooperative. The maize sheller can remove maize kernels&nbsp;from cobs of 40bags of 90kgs per day. The price of maize is Ksh. 6000 90kg bag.</span></span></span><br />\r\n&nbsp;','<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Increased efficiency and productivity.<br />\r\nReduced labor cost.<br />\r\nIt has improved kernel quality.<br />\r\nIncreased access to market.<br />\r\nTime saving.</span></span></span><br />\r\n&nbsp;','0','Production',1,10,'County ASDSP II offices',NULL,NULL,NULL,169,97,72,50,'170039678770X.jpg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,21,NULL,'2023-11-19 09:42:17','2023-11-19 09:42:17','253','Suguta Marmar','Delivered to beneficiaries','63','56','34','16','0','Payo Loronyokie','0711180399',NULL,NULL,'<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Lolmolog cereals farmers cooperative Ltd&nbsp;is located near lolmolog dispensary, Lolmolog&nbsp;village.&nbsp; The innovation&nbsp;was aiming to improve the efficiency and productivity of maize farming operations, it also aims to enhances&nbsp;their agricultural practices, increase income&nbsp;and improve their overall well being. The cooperative developed concepts&nbsp;for support from various development partners&nbsp;within&nbsp;the county.&nbsp;One of the concept&nbsp;was maize motorized sheller machine&nbsp;&nbsp;which they submitted to ASDSP II Samburu County.</span></span></span><br />\r\n&nbsp;',NULL),(319,35,'DOUBLE GREEN SELF HELP GROUP','KINUNGI','36.5355','0.8041','Pyrethrum Tissue culture nursery bulking','54H17794','Bulk the material to obtain adequate pyrethrum planting material.','Pyrethrum Tissue culture seedlings(5000 &nbsp;tissue culture seedlings )','Increased income , improved livelihood.','0','Animal / crop Breeding innovations',4,24,'County ASDSP II offices',NULL,NULL,NULL,30,17,13,5,'170021328650X.jpg',NULL,NULL,'Pending',NULL,NULL,'Submitted','2023-11-20 08:09:00','2220',2220,NULL,'2023-11-20 05:08:28','2023-11-20 05:09:00','207','NAIVASHA EAST','Delivered to beneficiaries','13','12','4','1','0','John Kinyanjui Ndungu','0722629043',NULL,NULL,'Double green Self Help Group was started in 2014. The activities the group was involved in were green house farming of horticultural crops in 2014 the group was given pyrethrum by the County but it did not do well.Members of the group collects member contributions and invest in a SACCO as shares. At the moment they have acquired a loan and purchased two stalls at Ihendu market. The group was given 5000 &nbsp;pyrethrum Tissue culture seedlings and at the moment members have about 1/4 -1 acre of pyrethrum &nbsp;which they sell to PPCK.',NULL),(320,43,'Pioneer Dairy Self Help Group','Rwika','0034.829','03730.539','Boma- rhodes hay production and biling','05Q23161','<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,&quot;sans-serif&quot;\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">To increase Dairy cow&nbsp; milk&nbsp; production through improved fodder production for improved income and food security.</span></span></span></span></span></span><br />\r\n&nbsp;','<span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">&nbsp;Rhodes grass species&nbsp; is extremely adapted to a wide range of ecological conditions.&nbsp; Rhodes grass has a short growing season (4-6 months) and can yield 8 tonnes dry matter per year. The grass is highly palatable and has a CP content of 11%. &nbsp;</span></span><br />\r\n&nbsp;','&nbsp;Pioneer dairy was supported with farm inputs for establishment&nbsp;of boma rhodes in 15 acres of land. since then, they have harvested and baled a total of 700 bales with an average weight of 14kg. the same has been sold at kes 300 per bale generating kes 210,000. This has mostly been sold to the group members who have reported an increase in milk yield from an average of 8 liters per cow to 13 liters per cow.&nbsp;','0','Animal feeding innovations',4,2,'County ASDSP II offices',NULL,NULL,NULL,27,14,13,5,'170047527510X.jpeg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2225,NULL,'2023-11-20 07:16:31','2023-11-20 07:16:31','Mbeere South','Mbeti South','Delivered to beneficiaries','10','12','4','1','0','Victoria Wanja','0721843377',NULL,NULL,'Dairy cow milk farming in Embu is highly dependent on rain fed fodder production, leading to fluctuations of fodder availability depending on season.<span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">To counter this challenge, commercial hay production is being proposed as an innovation. </span></span>',NULL),(321,43,'Mburugu Dairy Cooperative Society','Kiriari Market','0.396954','37.477898','Sexed Semen','W4077713','<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,&quot;sans-serif&quot;\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">To&nbsp; increase dairy cow&nbsp; milk&nbsp; production through improved breeds for improved income and food security.</span></span></span></span></span></span><br />\r\n&nbsp;','<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,&quot;sans-serif&quot;\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Use of&nbsp;&nbsp; </span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Sexed semen is a breeding technology which ensures a&nbsp; 95%&nbsp; success&nbsp; rate of achieving the desired sex of a calf (heifer). Innovative usage of sexed semen has a potential to help deliver appropriate cattle genotypes to farmers efficiently. Sexed semen could benefit cattle farmers through availability of cattle of preferred sex (female calves for dairy production) and better matching of genotype to farmers&rsquo; production conditions. This is aimed at upgrading the dairy cows by improved breeding programme of the dairy herd. The overall result will be improved dairy productivity.</span></span></span></span></span></span><br />\r\n&nbsp;','The&nbsp; Cooperative was supported with a total of 50 straws of sexed semen and associated equipment&nbsp;in February 2023. So far all the straws have been used. first calving is expected in the month of December 2023.&nbsp;&nbsp;','0','Animal / crop Breeding innovations',4,2,'County ASDSP II offices',NULL,NULL,NULL,2716,1760,956,200,'170047918210X.jpg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2225,NULL,'2023-11-20 08:21:01','2023-11-20 08:21:01','491','Ruguru Ngandori','Delivered to beneficiaries','1600','916','160','40','0','Samuel Njeru','0720684858',NULL,NULL,'<span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">&nbsp;Majority of the dairy animals presently being kept in the county are crosses of Friesian, Ayrshire, Jersey and Guernsey breeds. Promoting mechanisms for proper breeding will improve productivity by improvement of genetic potential of the cow. Through use of sexed semen in </span></span></span><span style=\"font-family:Calibri,&quot;sans-serif&quot;\"><span style=\"font-size:11.0pt\"><span style=\"line-height:115%\">breeding of cows,&nbsp; </span></span></span>&nbsp;<span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">producers will be able to reduce the period to obtain a pedigree heifer. The overall cost of production using the sexed semen as opposed to conventional methods to pedigree will be reduced.</span></span></span>',NULL),(322,43,'Tegemeo CBO','Mbuvori Market','0.38833','37.463167','Digital Weigh Scale','05409S74','<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,&quot;sans-serif&quot;\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">1. </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">To enhance the capacity of trading value chain organizations to efficiently and accurately weigh milk.</span></span></span></span></span><br />\r\n&nbsp;','<p>The weighing scale is equipped with features like LCD display, foot tap, a platform and a Bluetooth for data transfer to the computer.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>','<span style=\"font-size:12pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-family:Symbol\">&middot; </span>Enhanced accuracy and efficiency in milk weighing and data processing for timely payment to producers.</span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-family:Symbol\">&middot; </span>&nbsp;Increased members&rsquo; confidence and trust gained through use of the digital scales accuracy in record keeping and reference.</span></span></span><br />\r\n<span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Tegemeo dairy chair reported reduced&nbsp;&nbsp; time of milk handling by 50%, reduced milk losses through data management by 95% and increased group membership by 5% as result of using the digitalized weighing scale linked to the organization database.</span></span>','0','Packaging & Branding',3,2,'County ASDSP II offices',NULL,NULL,NULL,630,360,270,120,'170049144810X.jpeg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2225,NULL,'2023-11-20 11:45:58','2023-11-20 11:45:58','Manyatta','Nginda','Delivered to beneficiaries','280','230','80','40','0','Cyrus Kago','0722959787',NULL,NULL,'<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,&quot;sans-serif&quot;\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Use of ordinary weigh scales and manual recording of milk supplied to trading cooperatives and self-help groups, leads to lack of accuracy and accountability to the&nbsp;&nbsp; supplier. Supporting use of digital weigh scales by milk trading value chain organizations, will enhance their efficiency in data capturing, record keeping, and accountability on amount of milk collected.</span></span></span></span></span></span><br />\r\n&nbsp;',NULL),(323,43,'Mbeere North Dairy Cooperative Society','Siakago','0.57269','37.6370','Biogas','L2489578','<span style=\"line-height:normal\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">To&nbsp; develop value chain resilient to climate change through installation of biogas </span></span></span>','<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,&quot;sans-serif&quot;\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Installation of biogas in the rural livelihood is a Climate Smart Agriculture (CSA) activity which </span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">significantly reduces methane and nitrous oxide emissions by anaerobic digestion of animal waste in the </span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">biogas digester. </span></span></span><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A biogas system comprises a large tank, or digester. Inside this tank, bacteria work symbiotically to convert organic waste into methane gas through the process of anaerobic digestion. Each day, the operator of a biogas system nourishes the bacteria inside the digester with household by-products such as manure from livestock.&nbsp; The methane gas produced by the bacteria inside biogas system may be used for cooking, lighting, and other energy needs.</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,&quot;sans-serif&quot;\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">The slurry from digester is rich in nutrients and is used to improve soil fertility for crops and fodder production.</span></span></span></span></span></span><br />\r\n&nbsp;','<span style=\"font-size:12pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-family:Symbol\">&middot; </span>Beneficiaries have reported improved crop performance especially kitchen garden vegetables and fodder after applying&nbsp;&nbsp; bio slurry.</span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-family:Symbol\">&middot; </span>Beneficiaries are able to save an average of ks. 3500 per month previously spent on LPG gas and firewood as well as diversifying its use for brooding of chicks</span></span></span><br />\r\n&nbsp;','0','Production',1,2,'County ASDSP II offices',NULL,NULL,NULL,27,21,6,3,'170049277410X.jpeg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2225,NULL,'2023-11-20 12:07:18','2023-11-20 12:07:18','174','Nthawa','Delivered to beneficiaries','19','5','2','1','0','Munyi Waititu','0726873005',NULL,NULL,'<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,&quot;sans-serif&quot;\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Dairy sector has expanded rapidly in</span></span></span> <span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">recent decades and will continue to do so as demand for dairy products continues to grow, driven by population and income growth. The quick expansion of the sector is a cause of land degradation and an important driver of deforestation. It is also responsible for methane and nitrous oxide&nbsp;&nbsp; emissions from ruminant digestion and manure&nbsp;&nbsp; management, and generally livestock contributes largest global source of&nbsp;&nbsp; methane emissions (FAO, 2010b). Promoting biogas installation to dairy cow producers is geared towards&nbsp;&nbsp; reduction of methane gas emission, availing clean source of energy for cooking, as well as reducing impact of deforestation and time spent by women fetching firewood.</span></span></span></span></span></span><br />\r\n&nbsp;',NULL),(324,43,'Kanja community dairy farmers\' co-operative society limited.','Kanja Market','0.38\'2812','37\'531660','Solar powered milk-prechiller','509038A9','The objective of the innovation is to reduce milk spoilage during collection thus reducing post production losses. It also uses solar energy thus promoting climate smart environment. The societies using the innovation have seen the reduction of post production losses&nbsp;fall to below 5%. The innovation also allows the society to collect milk from far areas without fear of getting the milk spoiled on transit.','The prechiller is made of two aluminium containers each with a capacity of&nbsp;50kg, which are mounted on both side in a motorbike enabling the transporter &nbsp;to collect 100kg of milk. The Aluminium containers are covered with solar energy absorbing materials, with a back-up battery. The system is well connected and fixed for ease of portability while ensuring the milk is chilled while being transported to society main cooling unit. The prechiller is an easy to clean containers hence very recommendable for milk collection.','The use of the pre-chiller has seen reduction of milk spoilage by transporters on transit. The innovation is able to chill the milk to below 5&ordm;C thus allowing the transporter collect milk without the urgency for chilling. The Solar powered system is cost efficient hence reducing energy cost to the society on milk chilling. The innovation is easy to maintain and affordable by many small growing dairy societies or groups, thus promoting milk production by farmer far from the society main cooling unit, as their can get collected and reach the station without spoilage.&nbsp;','0','Cooling innovations',5,2,'County ASDSP II offices',NULL,NULL,NULL,960,612,348,240,'170047918210X.jpg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2225,NULL,'2023-11-20 12:50:22','2023-11-20 12:50:22','492','Kagaari North','Delivered to beneficiaries','432','288','180','60','0','Simon Njue','0728104274',NULL,NULL,'The innovation was promoted following a proposal by the Kanja community dairy farmers cooperative to support them with an innovation to minimize milk spoilage during especially from the areas where milk collection was far from the main Society cooling station. There before, the society used to incur post harvest losses of more than 5% of the volume collected per month. However, the innovation became a game-changer has it chill milk up-to below 5&ordm;C. This ensure the milk collected as chilled as it is transported back to the society. The prechiller uses solar energy hence very efficiency and cost effective.',NULL),(325,43,'Kamen Self Help Group','Kavuru Kiringa','00\'30.573','037\'39.806','TC Banana Hardening Nursery','0V735069','<span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">To increase productivity of Banana value chain through improved supply of quality TC banana seedlings</span></span>','The innovation consisted of a structure measuring 15mx8m&nbsp;covered with shade net. It has a capacity of 6000 seedling. The group was supplied with 6700 plantlets in two batches for a start.','The group was supported with the first batch of 3300 TC plantlets which they sold at kes 100 generating a total of kes 330,000. Each group member has been able to increase their banana orchard with 40 TC banana seedlings from their nursery. The generated income has been able to move group members from kes 127 to kes 151','0','Animal / crop Breeding innovations',4,4,'County ASDSP II offices',NULL,NULL,NULL,19,16,3,3,'170063908830X.jpg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,32,NULL,'2023-11-23 10:15:31','2023-11-23 10:15:31','492','Kagaari North','Delivered to beneficiaries','15','1','1','2','0','George Njeru','0723932798',NULL,NULL,'<span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Limited supply of tissue culture (TC) seedlings&nbsp;was a major challenge in Banana value chain in the County. There &nbsp;was only one certified TC banana &nbsp;hardening nursery existing&nbsp; in the county. There was unmet demand of &nbsp;100,000 seedlings&nbsp; which were sourced&nbsp; from other counties. This made the cost&nbsp;of seedlings to be very high and&nbsp; inaccessible to producers.</span></span>',NULL),(326,43,'Kawanjara Commercial Village Cooperative Society','Kawanjara','0.2815','37.3334','Milk Dispenser (Milk ATM)','866X2190','To support women and youth in milk trade for improved income generation.','Milk ATM is a vending machine that is made up of durable stainless steel that makes it long lasting. Its equipped with a cooler to help keep milk fresh for at least 72 hours. Its calibrated to dispense milk accurately. It has 200 liters capacity','The supported group is able to dispense an average of 200 liters per day. there is an increase of price fo milk dispensed from kes 60 to kes 70 per liter. Milk is dispensed hygienically&nbsp;with minimal sources of contamination&nbsp;as compared to selling of milk which is not pasteurized. The clients are able to purchase milk depending on the amount of money one has.','0','Food/Product safety innovations',3,2,'County ASDSP II offices',NULL,NULL,NULL,330,193,137,25,'170109190210X.jpg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,32,NULL,'2023-11-27 11:15:32','2023-11-27 11:15:32','492','Kagaari South','Delivered to beneficiaries','175','130','18','7','0','Joseph Njeru','0710720762',NULL,NULL,'Dairy cow milk industry, is one of the key economic drivers playing a major role in improving economic and livelihood status of Embu farmers. the sector provides employment to several people directly or indirectly as farm employees , milk transporters, employees in cooperative and processing plants as well as those employed in input supply shops. However, engagement of women and youth at trade node was minimal. An increase in supply of traded milk has high prospects of women and youth empowerment&nbsp; as they can engage in gender friendly activities such as use of milk dispensers',NULL),(327,43,'Evurori Chicken  Mongers SHG','Ishiara Market','00\'27.187','037\'47.358','Indigenous chicken Aggregation Center','S4682611','<span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">To establish&nbsp; live chicken aggregation centres to support marketing</span></span></span>','The innovation consists of a stone walled structure roofed with iron sheets. it measures (18x6x10)m with twenty eight (28) wire meshed cages inside. The cages have a capacity of thirty (30) mature chicken each. They&nbsp;are meant to hold chicken during trading as well as what remains after trading.','Since the delivery of the innovation, traders are able sell chicken through out the week unlike previously when they were selling only twice per week during the market days. Currently group members are able to aggregate and sell at least two hundred mature chicken per month at an average of&nbsp;&nbsp;kes 800 per live chicken generating an average of kes 160,000 per month.&nbsp;This has increased the per capita income of indigenous chicken traders from kes 333 to kes 396.There is also improved access to market information since group members are&nbsp;able to share information amongst themselves.','0','Create new innovation',3,5,'County ASDSP II offices',NULL,NULL,NULL,28,13,15,12,'170124825930X.jpg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,2225,NULL,'2023-11-29 07:10:03','2023-11-29 07:10:03','174','Evurori','Delivered to beneficiaries','6','10','7','5','0','Gabriel Njue','0727882828',NULL,NULL,'<span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Indigenous chickens perform well in all agro-ecological zones in Embu county and ranks highly as an existing resource whose productivity can be increased with minimal resources.&nbsp;Rearing of indigenous chicken is highly suitable for vulnerable households and are often owned and managed by women and youth. The indigenous chicken value chain growth in Embu County is limited by among others&nbsp;unorganized marketing structure &amp; low access to marketing information. This created the need to establish two chicken aggregation centers in the lower part of Embu&nbsp;to enhance market access.</span></span></span>',NULL),(328,43,'Irangi Agribusiness Cluster','Irangi centre','0.2059','037.2901','Indigenous Chicken Multiplication Center','43580D21','<span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">To support the establishment of indigenous chicken multiplication center to facilitate the access of quality fertilized eggs to producers<font color=\"#0782c1\">.</font></span></span></span>','<span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">The innovation entails identifying a group through proposal writing&nbsp;where indigenous chicken multiplication&nbsp;center would be established.&nbsp; A deep litter poultry wooden house&nbsp;measuring 18x5x10m and roofed with iron sheets with an adjacent feed storing store. The house has a concrete floor for ease of cleaning.&nbsp;&nbsp;The group was supported with&nbsp; four hundred and fifty KALRO kienyenji day old chick to rear for supply of fertilized eggs to the community and as a source of &nbsp;their own incubation.</span></span></span>','During the first year of production, the VCO was able to produce seven hundred and eighty six crates of fertilized eggs which they sold to the community at the rate of kes 600 per crate generating kes 471,600. Among the layer there were eighty cocks which were sold to the community to upgrade the local chicken. The cocks generated kes 80,000 and a total of one hundred and eighty culls sold at kes 600 generating kes 108,000.','0','Animal / crop Breeding innovations',4,5,'County ASDSP II offices',NULL,NULL,NULL,16,4,12,2,'170126128130X.jpg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,32,NULL,'2023-11-29 11:37:00','2023-11-29 11:37:00','492','Kagaari North','Delivered to beneficiaries','3','11','1','1','0','Nancy Njeri Njeru','0715043155',NULL,NULL,'<span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Indigenous chickens perform well in all agro-ecological zones in Embu county and ranks highly as an existing resource whose productivity can be increased with minimal resources.&nbsp; Rearing of indigenous chicken is highly suitable for vulnerable households and are often owned and managed by women and Youth. The indigenous chicken value chain growth in Embu County is limited by poor access to improved breeding stock, inadequate supply of day-old chicks and quality fertilized eggs.The supply of quality day-old chicks and fertilized eggs is paramount for the success and sustainability of indigenous chickens, which are locally adaptable to the rural conditions. Most chicken farmers depend on hatcheries for the supply of day-old chicks, a small number have incubators while majority of farmers hatch their chicks by natural incubation. Fertility is therefore very important in chicken production. </span></span></span>',NULL),(329,43,'Health Life Juices SHG','Kathageri Market','0.386411','037.595540','Heat Impulse Sealer','9601P613','<span style=\"font-size:10pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-size:12.0pt\">Increase banana value chain products reaching the market through proper packaging.&nbsp;</span></span></span><br />\r\n&nbsp;','An impulse sealer is a powered device that&nbsp;<strong>seals various types of plastic packaging</strong>, primarily flexible packaging like poly bags and stand up pouches. It utilizes an electrical impulse to heat a metal wire, melting a layer of plastic into another. The resulting permanent seal only breaks by cutting it open.','Improved presentation and efficiency in packages. It opened a wider market of the produce since it met one of the KEBS requirement for packaging of consumerble commodities.','0','Packaging & Branding',2,4,'County ASDSP II offices',NULL,NULL,NULL,15,7,8,14,'170135027540X.jpg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,32,NULL,'2023-11-30 11:10:20','2023-11-30 11:10:20','492','Kyeni North','Delivered to beneficiaries','1','0','6','8','0','Stephen Mutuanga','0798805440',NULL,NULL,'Banana processing in Embu has been at cottage level where the actors do the local drying and milling of banana flour without proper packaging. In most cases the actors have been using staples to seal their packages which may lead to incidences such as the customers ingesting the pin. At the same time this type of packaging was not apresentable and&nbsp; limited market access. To avoid this ASDSP II supported one of the value chain organization with a heat impulse sealer.',NULL),(330,43,'Kamen SHG','Kavuru Kiringa','00\'30.573','037\'47.358','Banana FFS','436411Q0','<span style=\"font-size:10pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-size:12.0pt\">To increase hectareage and yield of bananas to 90 acres and 30kgs per bunch respectively&nbsp;</span></span></span><br />\r\n&nbsp;','<span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">The Kagaari Kyeni Gaturi irrigation CBO &nbsp;identified six group within the organization to implement the project through FFS approach. The 6 groups formed the farmer field school&nbsp; targeting at least 30 members per school. The irrigation covered 3 sub locations and each sub location&nbsp;had 2 field schools. The field aimed at the best variety that&nbsp;performed in the identified sub location so that the PTD was banana varietal testing on performance. The FFS was&nbsp;facilitated by trained facilitators who&nbsp; capacity built members on best technologies in banana production and pest and disease management. Farmers&nbsp;learned in the school and practiced in their farms. </span></span>','<ol>\r\n	<li><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">The actors acquired knowledge and skills on banana husbandry management&nbsp;</span></span></li>\r\n	<li><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Increased&nbsp;acreage from the current 45 acres to at least 55 acres.&nbsp;</span></span></li>\r\n	<li><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Increased size of banana bunch from an average of 15kgs&nbsp; to an average of 30kgs per bunch </span></span></li>\r\n	<li><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Improved&nbsp;quality of the banana produced&nbsp; hence increasing the tradeable </span></span></li>\r\n</ol>','0','Production',1,4,'County ASDSP II offices',NULL,NULL,NULL,21,16,5,3,'170143737450X.jpg',NULL,NULL,'Pending',NULL,NULL,'Draft',NULL,NULL,32,NULL,'2023-12-01 10:29:50','2023-12-01 10:29:50','492','Kaggari South','Delivered to beneficiaries','15','3','1','2','0','George Njeru','0723932798',NULL,NULL,'<span style=\"font-size:10pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\">Banana is one of the priority value chain in Embu county and is an important food crop which plays a major role in the diet of both rural and urban households and the economy of the County. The crop is a source of income for the majority of small holder growers in Embu. This potential coupled with the environmental conservation attributes of the plant makes banana an ideal crop for economic growth and sustainability of the agricultural resource base. </span></span></span></span></span><br />\r\n<span style=\"font-size:10pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\">Despite the huge potential of banana production in Embu County the yield and quality is still very low</span></span> <span style=\"font-size:12.0pt\"><span style=\"line-height:150%\">due to various constraints such as p</span></span></span></span></span><span style=\"font-size:10pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\">oor banana orchard establishment and management among others.</span></span></span></span></span><br />\r\n&nbsp;',NULL);
